225	body	Textile	<p>\r\n  The Operations Committee is composed of Executive Board members and chaired by the Regional Council's vice president. The committee reviews and makes recommendations to the Executive Board on the budget and work program, and on contracts and other financial and personnel issues. The Operations Committee generally meets on the fourth Thursday of each month.\r\n</p>\r\n<div class="officers">\r\n  <img src="../images/officers-singer.jpg" height="140" alt="Sue Singer" width="100">\r\n  <p>\r\n    Mayor Pro Tem Sue Singer\r\n    <br>\r\n    Chair\r\n  </p>\r\n</div>\r\n<div class="officers">\r\n  <img src="../images/officers-singer.jpg" height="140" alt="Sue Singer" width="100">\r\n  <p>\r\n    Mayor Pro Tem Sue Singer\r\n    <br>\r\n    Chair\r\n  </p>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Next Meeting\r\n  </h2>\r\n  <h3>\r\n    February 22, 2007 - 9:30-9:55 a.m.\r\n  </h3>\r\n  <ul>\r\n    <li>Regional Council Board Room\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Past Meetings\r\n  </h2>\r\n</div>\r\n<h2>\r\n  Composition &amp; Membership\r\n</h2>\r\n<table class="compMember" cellspacing="0" border="0" width="100%" cellpadding="0">\r\n  <tr>\r\n    <th colspan="3">\r\n      King County/Cities (4)\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <td colspan="3"></td>\r\n  </tr>\r\n  <tr>\r\n    <td class="location" rowspan="3">\r\n      King County (2)\r\n    </td>\r\n    <td>\r\n      Councilmember Jane Hague\r\n    </td>\r\n    <td>\r\n      206-296-1011\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td>\r\n      Councilmember Julia Patterson\r\n    </td>\r\n    <td>\r\n      206-296-1013\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td>\r\n      <em>Vacancy (Alt.)</em>\r\n    </td>\r\n    <td>\r\n      &nbsp;\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td colspan="3">\r\n      <hr>\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td class="location" rowspan="2">\r\