342	body	Textile	The Regional Traffic Operations program promotes a coordinated approach to regional traffic operations investments and practices in the central Puget Sound region with an emphasis on:\r\n\r\n * Traffic signal enhancement and system coordination\r\n * Regional traffic operations (Active Traffic Management) at the arterial and freeway levels\r\n * Intelligent Transportation Systems (ITS)\r\n\r\nMore on Regional Traffic Operations:\r\n\r\n * Assessment of Puget Sound Regional Traffic Signal Operations Program [pdf]\r\n\r\n * USDOT ITS Signal Operation Brochure [pdf]\r\n\r\n * Maricopa County Final Report [pdf]\r\n\r\n * Planning for Operations\r\n * Active Traffic Management - ATM is a tool that can maximize safety and traffic flow by dynamically managing and controlling traffic based on the prevailing traffic conditions. Strategies include speed harmonization, queue warning, junction control, hard shoulder running, dynamic re-routing, and traveler information.\r\n	217
