117	body	Textile	<h2>\r\n  Best Practices\r\n</h2>\r\n<p>\r\n  Traditional land use tools do not always sufficiently guide new development. Regulatory reforms and financial incentives are tools that can make the difference. In 2002 and 2003, PSRC staff assesed various tools and incentives that can lead to success:\r\n</p>\r\n<ul>\r\n  <li>Best Practices Status Report: Results from legislative sessions related to financial incentives\r\n  </li>\r\n  <li>Financial incentives that support transit oriented development\r\n  </li>\r\n</ul>\r\n<h2>\r\n  Physical Design Guidelines\r\n</h2>\r\n<p>\r\n  Both Vision 2020 and Destination 2030, the region&sup1;s long range transportation plan, recognize the importance of urban form to mobility and the proper functioning of the transportation system. The region has committed to developing and promoting guidelines for designated urban centers and high capacity transit station areas, pursuant to GMA requirements and adopted regional policy.\r\n</p>\r\n<ul>\r\n  <li>\r\n    <a href="index.html#">Design Guidelines Manual</a> [pdf 30p 2.62MB]\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">Designation Criteria for Regional Growth and Manufacturing Industrial Centers</a> [pdf]\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">Center Plan Checklist</a> [pdf]\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">Parking Management Plan Checklist</a> [pdf]\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">The Development Toolkit: Success Stories from the Centers</a>\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">PSRC Funding Policy Framework</a> [pdf]\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">Characteristics of Centers, Appendix 1 of VISION 2020</a>\r\n  </li>\r\n  <li>\r\n    <a href="index.html#">Industrial Land Supply and Demand in the Central Puget Sound Region</a>\r\n  </li>\r\n</ul>\r\n<h2>\r\n  Technical Assistance\r\n</h2>\r\n<p>\r\n  Staff will routinely provide information to member jurisdictions and participate in coordination efforts with local governments, transit providers, and state agencies.\r\n</p>\r\n<p>\r\n  Contact Norman Abbott, 206-464-7134, Ben Bakkenta, 206-464-5372, or Rocky Piro, 206-464-6360.\r\n</p>\r\n	98
