34	body	Textile	The Puget Sound Regional Council is a regional planning agency with a mission to enhance the quality of life in the central Puget Sound region. PSRC is widely recognized as one of the best regional agencies of its type in the nation and is a great place to work.\r\n\r\nPSRC is an Equal Opportunity Employer. We're committed to hiring a high quality, professional and diverse workforce. The agency employs about 70 planners, data experts and administrative staff.\r\n\r\nh3. Positions\r\n\r\nNo positions currently available.\r\n\r\nh3. Applications\r\n\r\nAll applicants must submit a cover letter, resume, answers to all of the required questions, and a signed application.\r\n\r\n*Send completed materials one of the following ways:*\r\n\r\nEmail: <a href="mailto:hrdept@psrc.org">hrdept@psrc.org</a>\r\n\r\nFax: 206-587-4825\r\n\r\nMail:\r\n<address>\r\n Puget Sound Regional Council, Attn: HR <br />\r\n 1011 Western Ave., Suite 500 <br />\r\n Seattle, WA 98104\r\n</address>\r\n\r\nThe voluntary, confidential Equal Employment Opportunity form is appreciated for applicant tracking purposes. Questions or more information, please contact _Jillian Kornblatt_ at 206-464-6175, <a href="mailto:jkornblatt@psrc.org">jkornblatt@psrc.org</a>.\r\n	14
