119	body	Textile	<h2>\n  How to make a nomination\n</h2>\n<p>\n  Your nomination must include a cover page, project description and two supporting items. Two copies must be delivered to the offices of the Puget Sound Regional Council by <strong>December 20, 2006</strong>.\n</p>\n<h2>\n  Eligibility &amp; Criteria\n</h2>\n<p>\n  Nominations can be projects, programs or plans in the four-county region (King, Kitsap, Pierce and Snohomish counties) that are developed in the public or private sectors, or through public/private partnerships. Any individual, business, agency, organization or jurisdiction may submit a nomination.\n</p>\n<ul>\n  <li>Examples of projects include housing developments, transportation improvements, mixed-use development or redevelopment, open space preservation, and other similar efforts.\n  </li>\n  <li>Examples of programs and plans include comprehensive or subarea plans, economic development plans, design guidelines, outreach/education efforts, transportation demand management programs, and other similar efforts.\n  </li>\n</ul>\n<p>\n  All nominated projects, programs or plans should be well designed and/or well written, and should be innovative, creative, and, preferably, have the ability to be transferable to other locations within the region.\n</p>\n<p>\n  <strong>All nominated projects, programs or plans must have demonstrated significant progress in the past 12 months. If a program or plan, it must have been implemented/adopted and in use within the last 12 months.</strong>\n</p>\n<dl>\n  <dt>\n    Your cover page must include:\n  </dt>\n  <dd>\n    Name of nominated project, program or plan\n  </dd>\n  <dd>\n    Contact person, address, telephone number and fax of agency, jurisdiction, business, organization, or individual nominator.\n  </dd>\n  <dd>\n    Name, address, telephone number and fax of the principal individual responsible for the project, program or plan.\n  </dd>\n  <dd>\n    Name(s) of partnering agencies that you would like mentioned on the award.\n  </dd>\n</dl>\n<dl>\n  <dt>\n    You must include a one page description that includes the following:\n  </dt>\n  <dd>\n    Description of the nomination, with brief background on its development, time period of its preparation, and key participants.\n  </dd>\n  <dd>\n    Evidence of innovation as well as positive reception from the community.\n  </dd>\n  <dd>\n    Explanation of how and to what extent this project has been implemented.\n  </dd>\n  <dd>\n    Description of how the nomination meets two of the following criteria, please name the criteria you are referring to in your description:\n    <ol>\n      <li>Strategic and/or innovative investment in services, facilities or programs to support the development of livable communities.\n      </li>\n      <li>Improved proximity or access between home and work.\n      </li>\n      <li>Efficient development or redevelopment in urban, town or manufacturing/industrial centers.\n      </li>\n      <li>Improved economic activity through creation and retention of family-wage jobs and efficient movement of freight, goods and information.\n      </li>\n      <li>Increased supply and diversity of housing types, especially affordable housing.\n      </li>\n      <li>Increased opportunities and incentives to walk, bicycle or use public transit.\n      </li>\n      <li>Innovative pricing and financing methods to promote development in centers, encourage efficient use of the region's transportation system, and/or conserve the region's natural resources.\n      </li>\n      <li>Protection and conservation of rural areas, critical areas, and other aspects of the natural environment.\n      </li>\n    </ol>\n  </dd>\n</dl>\n<h3>\n  You must include at least two supporting items with your cover page and description.\n</h3>\n<dl>\n  <dt>\n    Supporting items can include:\n  </dt>\n  <dd>\n    Images of the project\n  </dd>\n  <dd>\n    A report, study or other background or supporting information.\n  </dd>\n  <dd>\n    A letter of support from an elected official, member of the community, or program participant.\n  </dd>\n</dl>\n<h3>\n  You must deliver two copies of your nomination to PSRC offices by December 20, 2006.\n</h3>\n<ul>\n  <li>Puget Sound Regional Council\n    <br>\n    attn: VISION 2020 Awards Program\n    <br>\n    1011 Western Ave Ste 500\n    <br>\n    Seattle, WA 98104\n  </li>\n</ul>\n<p>\n  For more information, contact Michele Leslie, <a href="mailto:mleslie@psrc.org">mleslie@psrc.org</a>, 206-587-4819\n</p>\n	101
