149	body	Textile	VISION 2020, the region's long-range growth management, economic and transportation strategy, and Destination 2030, the adopted Metropolitan Transportation Plan, call for the development of a transportation system that creates more travel choices while preserving environmental quality and open space. Bicycle and pedestrian transportation plays a key role in achieving these goals.\r\n\r\nBiking and walking are efficient, low-impact modes of travel that don't contribute to air pollution or traffic congestion. They provide mobility to all sectors of society, including the young, old, disabled, poor and others who may not drive. Well-designed, strategically located non-motorized facilities can also increase public transit ridership - such as on ferries, rail and bus - by providing better access to transit for more people. In addition, bicycle and pedestrian facilities can provide for economic development in downtowns, urban centers, and other mixed-use areas.\r\n\r\nThe Regional Council is committed to providing more and safer opportunities to walk and bike, and is working with communities throughout the region to plan for and implement effective non-motorized projects and programs.\r\n\r\nFor more information on any of the bicycle and pedestrian activities and programs, contact Kirste Johnson at 206-587-5665.\r\n\r\n	130
133	body	Textile	<p>\n  <strong>Adopted April 25, 2002</strong>\n</p>\n<p>\n  Thank you for visiting the Puget Sound Regional Council Web site and reviewing our Privacy Policy. This statement addresses collection, use and security of and access to information that may be obtained through use of our Web site. This notice covers the following topics:\n</p>\n<ul>\n  <li>\n    <a href="privacy-policy#info">Information Collected and How it is Used</a>\n  </li>\n  <li>\n    <a href="privacy-policy#personal">Personal Information and Choice</a>\n  </li>\n  <li>\n    <a href="privacy-policy#public">Public Access to Information</a>\n  </li>\n  <li>\n    <a href="privacy-policy#review">Review and Correction of Personally Identifiable Information</a>\n  </li>\n  <li>\n    <a href="privacy-policy#security">Security</a>\n  </li>\n  <li>\n    <a href="privacy-policy#disclaimer">Disclaimer</a>\n  </li>\n  <li>\n    <a href="privacy-policy#contact">Contact Information</a>\n  </li>\n</ul><a name="info" id="info"></a>\n<h2>\n  Information Collected and How it is Used\n</h2>\n<p>\n  We will collect <strong>no</strong> personal information about you when you visit our Web site unless you choose to give that information to us.\n</p>\n<h3>\n  Automatic Collection of Information\n</h3>\n<p>\n  If you do nothing during your visit to our Web site but browse, read pages, or download information, the following information will be automatically collected. This information does not identify you personally. We do not use cookies or any other methods to track individual user visits.\n</p>\n<ol>\n  <li>The Internet Protocol (IP) Address and domain name used\n  </li>\n  <li>The date and time of each visit\n  </li>\n  <li>The web pages and directories visited\n  </li>\n</ol>\n<p>\n  The information we collect automatically is used only to help us understand how our Web site is being used in order to improve the content and services provided.\n</p>\n<h3>\n  Volunteered Information\n</h3>\n<p>\n  If during your visit to our Web site you participate in a survey, send an email, or perform some other transaction online, the following additional information will be collected:\n</p>\n<ol>\n  <li>The email address and contents of email, including attachments. The information collected is not limited to text and may include any audio, video, and graphic information you send.\n  </li>\n  <li>Information volunteered in response to a survey\n  </li>\n  <li>Information volunteered through an online form for any other purpose\n  </li>\n</ol>\n<p>\n  We use your email information to respond appropriately. This may be to respond to you, to address issues you may identify, to further improve our Web site, or to forward the email for appropriate action. Survey information and information from other online forms is used only for the purpose stated on the requesting Web page. We will not sell, rent, or lease your personal information to third parties.\n</p><a name="personal" id="personal"></a>\n<h2>\n  Personal Information and Choice\n</h2>\n<p>\n  <strong>You may choose whether or not to provide personal information online.</strong>\n</p>\n<p>\n  "Personal information" is information about a person that is readily identifiable to that specific individual. Personal information includes such things as an individual's name, address, and phone number. A domain name or IP address is not considered personal information.\n</p>\n<p>\n  We collect no personal information about you unless you voluntarily provide it to us by sending us email, participating in a survey, or completing an online form. You may choose not to contact us by email, participate in a survey or to provide any personal information using an online form. Your choice to not participate in these activities will not impair your ability to browse the Regional Council Web site, but you may not be able to read or download certain information online. That information will be available if you contact the agency by mail, fax or telephone.\n</p>\n<p>\n  If personal information is requested on the Web site or volunteered by the user, state law and the federal Privacy Act of 1974 may protect it. However, this information is a public record once you provide it, and may be subject to public inspection and copying if not protected by federal or state law.\n</p>\n<p>\n  If you believe that your personal information is being used for a purpose other than what was intended when submitted, you may contact the Regional Council, as shown in the <a href="privacy-policy#contact">Contact Information</a> section of this statement.\n</p>\n<p>\n  Users are cautioned that the collection of personal information requested from or volunteered by children online or by email will be treated the same as information given by an adult, and may be subject to public access.\n</p><a name="public" id="public"></a>\n<h2>\n  Public Access to Information\n</h2>\n<p>\n  In the State of Washington, laws exist to ensure that government is open and that the public has a right to access appropriate records and information possessed by state government. At the same time, there are exceptions to the public's right to access public records that serve various needs including the privacy of individuals. Exceptions are provided by both state and federal laws.\n</p>\n<p>\n  All of the information collected at this site becomes public records that may be subject to inspection and copying by members of the public, unless an exemption in law exists. <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.260&amp;fuseaction=section">RCW 42.17. 260(1)</a> states that:\n</p>\n<blockquote>\n  <p>\n    Each agency, in accordance with published rules, shall make available for public inspection and copying all public records, unless the record falls within the specific exemptions of subsection (6) of this section, RCW <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.310&amp;fuseaction=section">42.17.310</a>, <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.315&amp;fuseaction=section">42.17.315</a>, or other statute which exempts or prohibits disclosure of specific information or records. To the extent required to prevent an unreasonable invasion of personal privacy interests protected by RCW <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.310&amp;fuseaction=section">42.17.310</a> and <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.315&amp;fuseaction=section">42.17.315</a>, an agency shall delete identifying details in a manner consistent with RCW <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.310&amp;fuseaction=section">42.17.310</a> and <a href="http://www.leg.wa.gov/RCW/index.cfm?section=42.17.315&amp;fuseaction=section">42.17.315</a> when it makes available or publishes any public record; however, in each case, the justification for the deletion shall be explained fully in writing.\n  </p>\n</blockquote>\n<p>\n  In the event of a conflict between this Privacy Notice and the Public Records Act or other law governing the agency&rsquo;s disclosure of records, the Public Records Act or other applicable law will control.\n</p><a name="review" id="review"></a>\n<h2>\n  Review and Correction of Personally Identifiable Information.\n</h2>\n<p>\n  You can review any personally identifiable information we collect about you by using the information in the <a href="privacy-policy#contact">Contact Information</a> section at the end of this Notice. You may recommend changes to your personally identifiable information you believe to be inaccurate by submitting an email or written request that credibly shows the inaccuracy. We will take reasonable steps to verify your identity before granting access or making corrections. <a href="http://www.leg.wa.gov/RCW/index.cfm?section=43.105.310&amp;fuseaction=section">(RCW 43.105.310)</a>\n</p><a name="security" id="security"></a>\n<h2>\n  Security\n</h2>\n<p>\n  The Regional Council, as developer and manager of this Web site, has taken several steps to safeguard the integrity of its data and prevent unauthorized access to information maintained by the Regional Council. These measures are designed and intended to prevent corruption of data, block unknown or unauthorized access to our systems and information, and to provide reasonable protection of private information in our possession.\n</p>\n<p>\n  This information should not be construed in any way as giving business, legal, or other advice, or warranting as fail proof, the security of information provided via the Regional Council Web site.\n</p><a name="disclaimer" id="disclaimer"></a>\n<h2>\n  Disclaimer\n</h2>\n<p>\n  The Regional Council Web site has links to many other Web sites operated by government agencies, nonprofit organizations, and private businesses. When you link to another site, you are no longer on the Regional Council Web site and this Privacy Notice will not apply. When you link to another Web site, you are subject to the privacy policy of that new site.\n</p>\n<p>\n  Neither the Puget Sound Regional Council, nor any officer or employee of the Puget Sound Regional Council warrants the accuracy, reliability or timeliness of any information published by this system, nor endorses any content, viewpoints, products, or services linked from this system, and shall not be held liable for any losses caused by reliance on the accuracy, reliability or timeliness of such information. Portions of such information may be incorrect or not current. Any person or entity that relies on any information obtained from this system does so at their own risk.\n</p><a name="contact" id="contact"></a>\n<h2>\n  Contact Information\n</h2>\n<p>\n  To review your personal information, or request correction of your personal information:\n</p>\n<ul>\n  <li>Mark Demry\n  </li>\n  <li>Puget Sound Regional Council\n  </li>\n  <li>1011 Western Avenue, Suite 500\n  </li>\n  <li>Seattle WA 98104\n  </li>\n  <li>206-464-7090\n  </li>\n  <li>FAX 206-587-4825\n  </li>\n  <li>\n    <a href="mailto:mdemry@psrc.org">mdemry@psrc.org</a>\n  </li>\n</ul>\n<br>\n<p>\n  To offer comments about the Puget Sound Regional Council Web site, or about the information presented in this Privacy Policy:\n</p>\n<ul>\n  <li>Information Center\n  </li>\n  <li>Puget Sound Regional Council\n  </li>\n  <li>1011 Western Avenue, Suite 500\n  </li>\n  <li>Seattle WA 98104\n  </li>\n  <li>206-464-7532\n  </li>\n  <li>FAX 206-587-4825\n  </li>\n  <li>\n    <a href="mailto:infoctr@psrc.org">infoctr@psrc.org</a>\n  </li>\n</ul>\n	114
