355	body	Textile	*Welcome to the PSRC Data home page.*  The PSRC Data Systems and Analysis Division administers a regional data development and research program in support of growth management, transportation and economic development planning in the central Puget Sound region.  We develop and maintain an array of regional planning data sets, and deliver technical assistance to our member governments and organizations.  Our standard data products and reports are available free of charge to the public.\r\n\r\n*Data Products.*  Standard data products and reports include:\r\n\r\n * U.S. Census Bureau data for the region\r\n * employment estimates\r\n * GIS maps, shape files and related products\r\n * land use and travel demand forecasts and modeling information\r\n * population and housing estimates\r\n * PSRC survey data\r\n * transportation data\r\n\r\n\r\n*Data Index.*  Directory of data products by Data Category or Subject Area.\r\n\r\n*Custom Data.* Need data or maps in a different format from our standard data products?  Read about our Custom Data policy.	220
