153	body	Textile	<p>\n  The Regional Freight Mobility Roundtable is a nationally recognized public-private forum to define and recommend actions serving freight mobility needs in and through central Puget Sound.\n</p>\n<p>\n  Private sector participants include rail, marine, air cargo and trucking carriers, and shippers such as Boeing and Weyerhaeuser. Public sector participants include local governments, the ports of Seattle, Tacoma and Everett, state agencies, and federal agencies within the U.S. Department of Transportation (including rail, highway, maritime) and the Department of Defense. As a shared "communication hub", the Roundtable is consulted by the FAST Corridor and provides input into regional and state transportation plans.\n</p>\n<h3>\n  Finance\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Innovative Finance: A Project Selection Case Study</a>. June 2006\n  </li>\n</ul>\n<h3>\n  Freight Story\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Mission Statement</a>\n  </li>\n  <li>\n    <a href="roundtable#">The Regional Freight Story</a>. Leading messages on freight mobility within and through the Puget Sound regional Gateway, May 6, 2005 (40 images)\n  </li>\n  <li>\n    <a href="roundtable#">Washington Transportation Plan Update, Freight Systems</a>. Update to the Washington freight system, including some funding actions of the 2005 Legislature, May 6, 2005\n  </li>\n</ul>\n<h3>\n  Prosperity Partnership\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Alignment for Action</a>. Presentation to the Roundtable, January 6, 2006\n  </li>\n  <li>\n    <a href="roundtable#">Economics &amp; Environment: 2 Faces of Globalization</a>. Presentation to the Association of Pacific Ports Annual Conference, August 21-24, 2005\n  </li>\n</ul>\n<h3>\n  Rail\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Railroads and the Central Puget Sound Region</a>. Presentation at Western Regional Grade-Crossing Conference, Vancouver, Washington, June 7, 2006\n  </li>\n  <li>\n  