able#">Meeting Summary</a>\n  </li>\n  <li>\n    <a href="roundtable#">Meeting Notes</a>\n  </li>\n</ul>\n<h3>\n  May 6, 2005\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n  <li>\n    <a href="roundtable#">Meeting Notes</a>\n  </li>\n</ul>\n<h3>\n  March 4, 2005\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Notes</a>\n  </li>\n</ul>\n<h3>\n  January 7, 2005\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n  <li>\n    <a href="roundtable#">Meeting Notes</a>\n  </li>\n  <li>\n    <a href="roundtable#">Washington State FMSIB Benchmarking Project Evaluation</a>\n  </li>\n  <li>\n    <a href="roundtable#">Connecting the Region (Sound Transit)</a>\n  </li>\n</ul>\n<h3>\n  November 5, 2004\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n  <li>\n    <a href="roundtable#">The Current State of the Nation's Railroads</a>\n  </li>\n</ul>\n<h3>\n  September 3, 2004\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n</ul>\n<h3>\n  May 7, 2004\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n</ul>\n<h3>\n  March 5, 2004\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Summary</a>\n  </li>\n</ul>\n<h3>\n  September 5, 2003\n</h3>\n<ul>\n  <li>\n    <a href="roundtable#">Meeting Notes</a>\n  </li>\n  <li>\n    <a href="roundtable#">Boeing Company presentation</a>\n  </li>\n</ul>\n	135
154	body	Textile	<p>\n  As part of regional planning analysis, the Puget Sound Regional Council concluded that if improvements to the regional transportation system are to be made, new capacity investments will need to involve innovative financing strategies. With this in mind, the region resolved to develop and execute a transportation congestion pricing demonstration project as an important step in understanding options for sustaining regional mobility well into the future.\n</p>\n<p>\n  Representative drivers from throughout the region participated in the 18 month study. Four-hundred and fifty vehicles from over 275 households were outfitted with an in-vehicle (taxi-like) metering device. The Traffic Choices Meter identifies vehicle location and displays the cost to use a road at the time it is being used.\n</p>\n<p>\n  During the demonstration, the effects of the road pricing were to be measured by comparing the travel behavior of volunteer participants with and without a congestion tolls applied to their use of the region's roads. To support the experiment, the project deployed a toll system that could toll both highways and surface streets, faithfully simulate efficient system-wide pricing, and accurately measure pricing response. By implication, the on-board metering devices needed to accurately pinpoint each vehicle location (GPS receiver), match the vehicle location with tolled facilities (digital road map and map matching features), and communicate trip costs (cellular modem and in-vehicle display). The study was designed to expose participating drivers to congestion-pricing-type road user charges.\n</p>\n<p>\n  Once all participating households were recruited, each household vehicle was equipped with a Siemens GPS tolling device or On-Board Unit (OBU). No details of the experimental procedures were provided to the participants during an initial period of data collection, during which baseline household-level travel information was collected. The baseline travel information was used to develop unique travel budgets for each participating household. These travel budgets were loaded into accounts, against which tolls were levied during the experimental portion of the study. And any funds remaining in the account at the end of the study were kept by the participants. This "hold-harmless" study design give participants the opportunity to participate without committing their own funds, yet provided the incentive to adjust their driving behavior so as to enjoy the surplus remaining in the account at the end of the experiment.\n</p>\n<h2>\n  A Partnership\n</h2>\n<p>\n  The study is being funded by a grant from the Federal Highway Administration, and led by the Puget Sound Regional Council along with our partner the Washington State Department of Transportation.\n</p>\n<p>\n  The Puget Sound Regional Council is the regional transportation, economic and growth planning agency for the central Puget Sound region of Washington State. The Regional Council serves as a forum for cities, counties, ports, transit agencies, tribes, and the state to coordinate on important regional issues.\n</p>\n<p>\n  The Puget Sound Regional Council is getting assistance from of a team of experts in the fields of economic analysis, transportation analysis and engineering, and public involvement.\n</p>\n<p>\n  Siemens is responsible for developing the software, providing the in-vehicle on board units and integrating all the systems and components. It is also providing technical support. Siemens is an $80 billion electronics company with 420,000 employees in 192 countries. Siemens provides products and services to improve infrastructure through technology and innovation in automation and control, information and communications, lighting, medical, power and transportation. The United States is one of Siemens' largest markets with 11 of their worldwide businesses based here.\n</p>\n	137
