93	body	Textile	<p>\r\n  The Puget Sound Regional Council is committed to ensuring that everyone in the region has an opportunity to participate in regional planning decisions. Our <a href="public-involvement#">public participation plan</a> describes the ways PSRC encourages early and continuous public involvement in its activities.\r\n</p>\r\n<dl>\r\n  <dt>\r\n    How to get involved and stay informed:\r\n  </dt>\r\n  <dd>\r\n    <a href="public-involvement#">Attend a board meeting</a>\r\n  </dd>\r\n  <dd>\r\n    <a href="http://psrctest.cevian.net/information-center/publications/newsletter-signup.php">Subscribe to our monthly newsletter, Regional VIEW</a>\r\n  </dd>\r\n  <dd>\r\n    <a href="http://psrctest.cevian.net/information-center/">Contact the Information Center to get copies of PSRC reports and other information</a>\r\n  </dd>\r\n</dl><a id="request" name="request"></a>\r\n<h2>\r\n  Request a Speaker\r\n</h2>\r\n<p>\r\n  Interested in learning more about growth and transportation challenges facing the central Puget Sound region? To arrange for a speaker for your chamber of commerce, community group, or similar organization, contact Michele Leslie at (206) 587-4819, or mleslie@psrc.org.\r\n</p>\r\n<h2>\r\n  Schedule Bob Drewel to Speak\r\n</h2>\r\n<p>\r\n  <strong>"Our Regional Journey: What's Next?"</strong>\r\n</p><img class="imgLeft" src="../images/drexel-thumb.jpg" height="82" alt="Bob Drexel" width="72">\r\n<p>\r\n  Bob Drewel, former Snohomish County Executive and new Executive Director of the Puget Sound Regional Council will discuss the ways the region is preparing to move forward together on transportation, land use and an economic agenda.\r\n</p>\r\n<p>\r\n  He'll share a little about the role of the PSRC in planning and funding transportation projects and focus on next steps to improving the region's ability to compete in the world economy by thinking and acting like one region.\r\n</p>\r\n<p>\r\n  <a href="bob-drewel">Bob Drewel's Biography</a>\r\n</p>\r\n<p>\r\n  To schedule Bob Drewel to speak to your group or organization, <a href="request-bob-drewel">please complete this form</a>.\r\n</p>\r\n	74
