98	body	Textile	<p>\n  The Puget Sound Regional Council serves both the public and private sectors in the central Puget Sound region, creating and implementing growth and transportation policies, developing and disseminating information, and providing a forum for collaborative decision making.\n</p><img src="../images/staff-photo.jpg" height="130" alt="psrc staff" width="390">\n<h3>\n  In carrying out our responsibilities, we will:\n</h3>\n<ul>\n  <li>Maintain a standard of excellence for all products and services;\n  </li>\n  <li>Manage resources efficiently and effectively;\n  </li>\n  <li>Encourage practical environmentally sustainable work practices throughout the agency;\n  </li>\n  <li>Be responsive, accessible and accountable to our constituents, and encourage their involvement and ownership in the agency;\n  </li>\n  <li>Use a positive team approach that extends from within the agency to the community;\n  </li>\n  <li>Emphasize integrity, professionalism and respect as we conduct our business and interact with one another;\n  </li>\n  <li>Respect diversity, acknowledging that we all have differences and similarities, strengths and weaknesses, and gifts and attributes that make us unique, and that all of us, individually and collectively, are important partners in this agency's success;\n  </li>\n  <li>Foster an open, communicative and congenial atmosphere that promotes creativity, flexibility, risk taking and innovation; and\n  </li>\n  <li>Encourage excellence in job performance through recognition, opportunities for growth, and employee participation in decision making.\n  </li>\n</ul>\n	79
116	body	Textile	<p>\r\n  Designated growth centers are a hallmark of the regional growth strategy, Vision 2020. Reginal growth centers are areas that are targeted for population, housing and employment growth as well as transportation funds.\r\n</p>\r\n<p>\r\n  PSRC periodically tracks the progress and development of the region's designated centers. The following Puget Sound Milestones report contains detailed population, employment, and housing trends for the 21 regional growth centers that had been designated as of summer 2002. The report also takes a first look at the region's eight designated manufacturing/industrial centers. Four more regional growth centers (Auburn, Burien, Silverdale and Totem Lake) have been designated since the publication of this report. report assesses the region's progress toward its stated policy goals of focusing new growth within designated regional growth centers, brings together new census data, contains conclusions and recommendations from a regional workshop held in February 2002, and highlights direction for regional centers provided by the Growth Management Policy Board.\r\n</p>\r\n<dl>\r\n  <dt>\r\n    Puget Sound Milestones:\r\n  </dt>\r\n  <dd>\r\n    <a href="index.html#">Central Puget Sound Regional Growth Centers Report</a>\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Cover and Table of Contents</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Executive Summary</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Chapter 1: VISION 2020, Destination 2030 and the Centers Strategy</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Chapter 2: Regional Growth Centers</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Chapter 3: Manufacturing/Industrial Centers</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Chapter 4: Application of Design Guidelines in Regional Growth Centers</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Chapter 5: Findings, Issues and Recommendations</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Appendix A: Methodology</a> [pdf]\r\n  </dd>\r\n  <dd>\r\n    <a href="index.html#">Appendix B: Design Guideline Questionnaire</a> [pdf]\r\n  </dd>\r\n</dl>\r\n<p>\r\n  For more information, contact Ben Bakkenta, 206-464-5372, or Rocky Piro, 206-464-6360.\r\n</p>\r\n	97
115	body	Textile	<h2>\r\n  <a href="index.html#">VISION 2040</a>\r\n</h2>\r\n<p>\r\n  We know that our region will experience continued growth - in fact, we're expecting more than a million and a half more people to live here by the year 2040. That's the equivalent of a new Portland, Oregon metropolitan area entering our region. Where should these new jobs and households be located? How might they affect our communities, our environment, and our transportation system? Your Decisions - Your Plan . . .\r\n</p>\r\n<h3>\r\n  About VISION 2040\r\n</h3>\r\n<p>\r\n \r\n</p>\r\n<h2>\r\n  <a href="index.html#">Regional Centers</a>\r\n</h2>\r\n<p>\r\n  Designated growth centers are a hallmark of the regional growth strategy, Vision 2020. Reginal growth centers are areas that are targeted for population, housing and employment growth as well as transportation funds.\r\n</p>\r\n<h2>\r\n  <a href="index.html#">Toolkit and Resources</a>\r\n</h2>\r\n<p>\r\n  Best Practices. Traditional land use tools do not always sufficiently guide new development. Regulatory reforms and financial incentives are tools that can make the difference.\r\n</p>\r\n	96
118	body	Textile	<h2>\n  Nominations are now open!\n</h2>\n<p>\n  The Awards recognize inspiring projects, plans, and programs that increase the vitality of the central Puget Sound region. Nominations will be accepted until December 20, 2006. The awards will be presented at the PSRC's General Assembly in spring 2007. Tacoma Deputy Mayor Mike Lonergan will chair the selection committee. Award nomination materials are available here.\n</p>\n<p>\n  For more information, contact Michele Leslie, <a href="mailto:mleslie@psrc.org">mleslie@psrc.org</a>, 206-587-4819.\n</p>\n<h3>\n  Schedule\n</h3>\n<ul>\n  <li>October 2006 - Nominations open\n  </li>\n  <li>December 20, 2006 - Nominations Close\n  </li>\n  <li>January 2007 - Complete Nominations are Reviewed by Regional Staff\n  </li>\n  <li>February 2007 - Awards Selection Committee Meets\n  </li>\n  <li>Spring 2007 - Awards are Presented at General Assembly\n  </li>\n</ul>\n<h2>\n  Awards Selection Committee\n</h2>\n<p>\n  The VISION 2020 Award winners are selected by an 11-member committee. Nine members are officials who serve on the PSRC's Executive Board and Transportation and Growth Management Policy Boards, and two are outside regional experts. The 2007 Awards Selection Committee will be chaired by Tacoma Deputy Mayor Mike Lonergan.\n</p>\n	100
