136	body	Textile	<h2>\n  2007-2010 TIP Approved <span>NEW</span>\n</h2>\n<p>\n  PSRC received official notice by FHWA &amp; FTA that the 2007-2010 STIP is approved effective February 6, 2007. Project sponsors are now encouraged to obligate projects. For more information please call Larry Burris at 206-464-5301 or email him at lburris@psrc.org.\n</p>\n<h2>\n  Certification Form for Project Sponsors\n</h2>\n<p>\n  Updated Annual Certification Form, to be completed by all Project Sponsors with projects in the current Regional TIP. Information is included in the memo listed below.\n</p>\n<ul>\n  <li>\n    <a href="index.html">Memo</a> [pdf - Dec 2006]\n  </li>\n  <li>\n    <a href="index.html">Certification Form</a> [pdf - Dec 2006]\n  </li>\n</ul>\n<p>\n  <a href="index.html#">Transit Agencies Triennial Review Information</a>\n</p>\n	116
137	body	Textile	<p>\n  The 2006 project selection process to distribute PSRC's FFY 2008-2010 STP, CMAQ and FTA funds has been concluded. The links below provide the background information, schedule and application forms for both regional competitions. This year, elements of the adopted Regional Economic Strategy have been incorporated into the project selection process, specifically relating to the five targeted industry clusters of aerospace, clean technology, information technology, life sciences and logistics and international trade.\n</p>\n<h2>\n  Projects Recommended from the 2006 Project Selection Process\n</h2>\n<ul>\n  <li>\n    <a href="project-selection#">All Projects Recommended for Funding</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Projects Recommended RPEC for Regional STP/CMAQ Funds</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Projects Recommended for Countywide STP/CMAQ Funds</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Projects Recommended for FTA Competitive Funds</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Projects Recommended for FTA Noncompetitive Funds</a> [pdf]\n  </li>\n</ul>\n<h3>\n  Contingency Lists\n</h3>\n<ul>\n  <li>\n    <a href="project-selection#">Contingency Projects RPEC Recommended for Regional STP/CMAQ Funds</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Contingency Projects Recommended for Countywide STP/CMAQ Funds</a> [pdf]\n  </li>\n  <li>\n    <a href="project-selection#">Contingency Projects Recommended for FTA Competitive Funds</a> [pdf]\n  </li>\n</ul>\n<h2>\n  Background Information\n</h2>\n<ul>\n  <li>\n    <a href="project-selection#">STP/CMAQ and FTA Regional Competitions</a>\n  </li>\n</ul>\n<h2>\n  Regional Economic Strategy Information\n</h2>\n<p>\n  Refer to <a href="http://psrctest.cevian.net/psrc-funding/TIP/www.prosperitypartnership.org/clusters/index.htm">www.prosperitypartnership.org/clusters/index.htm</a>; for questions contact Eric Schinfeld, eschinfeld@psrc.org or 206-587-5063.\n</p>\n<p>\n  The links below contain the types of industry within each cluster and their geographic location:\n</p>\n<ul>\n  <li>Aerospace - <a href="project-selection#">Definition of Cluster</a> (NAICS Codes, Map)\n  </li>\n  <li>Clean Technology - <a href="project-selection#">Definition of Cluster</a> (NAICS Codes, Map)\n  </li>\n  <li>Information Technology - <a href="project-selection#">Definition of Cluster</a> (NAICS Codes, Map)\n  </li>\n  <li>Life Sciences - <a href="project-selection#">Definition of Cluster</a> (NAICS Codes, Map)\n  </li>\n  <li>Logistics &amp; International Trade - <a href="project-selection#">Definition of Cluster</a> (NAICS Codes, Map)\n  </li>\n</ul>\n<h3>\n  The Regional Council is responsible for distributing federal highway and transit funds under the following programs:\n</h3>\n<ul>\n  <li>Surface Transportation Program (STP)\n  </li>\n  <li>Congestion Mitigation and Air Quality (CMAQ)\n  </li>\n  <li>Federal Transit Administration (FTA)\n    <ul>\n      <li>Section 5309 Fixed Guideway\n      </li>\n      <li>Section 5307 Urbanized Area Formula Funds\n      </li>\n    </ul>\n  </li>\n</ul>\n<p>\n  Each funding source has its own eligibility requirements. STP, CMAQ and FTA funds are distributed approximately every two years through a project selection process. The Policy Framework describes this process more thoroughly. The TIP also contains regionally significant projects using other funding sources. In years without a project competition, agencies have an opportunity to submit these projects to the "Air Quality Amendment to the Regional TIP."\n</p>\n<h2>\n  Past Call for Projects\n</h2>\n<p>\n  <a href="project-selection#">2004 Regional Project Competition for PSRC Funds</a>\n</p>\n	119
