142	body	Textile	<p>\n  The Historic Airport Documents Index summarizes major airport planning related reports prepared by the Puget Sound Regional Council (PSRC) and other agencies. It also includes studies, correspondence, litigation, and public comments collected by the PSRC Information Center and cataloged either as standalone volumes or combined in binders.\n</p>\n<p>\n  PSRC published its first Regional Airport System Plan in 1969. Since that time the Regional Council has been involved in a wide variety of planning activities related to the regional airport system. Our historic airport documents collection dates from 1988, when PSRC published its 1988 update of the Regional Airport System Plan. The plan launched the region into a lengthy planning process related to commercial airport capacity, primarily focused on addressing capacity issues at Sea-Tac International Airport. For more historical information and a timeline, see <a href="http://psrctest.cevian.net/transportation/air-transportation/timeline.htm">General Chronology: Regional Commercial Airport Capacity Decisions in the Central Puget Sound Region</a>.\n</p>\n<dl>\n  <dt>\n    The major phases of this ongoing planning process included:\n  </dt>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/psatc.htm">Puget Sound Air Transportation Committee</a> (December 1989-March 1992)\n  </dd>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/fp.htm">Flight Plan</a> (January-August 1993)\n  </dd>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/msa.htm">Major Supplemental Airport Feasibility Study</a> (February-October 1994)\n  </dd>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/xp.htm">Expert Arbitration Panel on Demand/System Management and Noise Reduction</a> (1994-1996)\n  </dd>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/xpf.htm">Expert Panel Decision Follow Up</a> (1996)\n  </dd>\n  <dd>\n    <a href="res-a9602/index.html">Resolution A-96-02</a> (1996)\n  </dd>\n  <dd>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/imp.htm">Resolution A-96-02 Implementation documents</a> (1996-2004)\n  </dd>\n</dl>\n<p>\n  In addition, the index includes documents about the <a href="http://psrctest.cevian.net/transportation/air-transportation/conhearing.htm">Congressional Hearing</a> held March 18, 1996, <a href="http://psrctest.cevian.net/transportation/air-transportation/rasp.htm">Regional Airport System Plan documents</a> (1988-2000) and <a href="http://psrctest.cevian.net/transportation/air-transportation/psrc.htm">airport-related Puget Sound Regional Council Publications</a> (1988-1992).\n</p>\n<p>\n  Also see <a href="publications">major airport documents</a> available online.\n</p>\n<p>\n  The PSRC Information Center (<a href="mailto:infoctr@psrc.org">infoctr@psrc.org</a>, 206-464-7532) can help you obtain documents that were published by the PSRC. Other documents may be viewed at the Information Center during regular business hours.\n</p>\n	125
