op.htm">Property Acquisition Financial Feasibility Study</a>. July 1997\n  </li>\n</ul>\n<h2>\n  1996\n</h2>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/expertpaneldecision.pdf">Expert Arbitration Panel Final Decision on Noise Issues</a>. March 27, 1996\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/resa9602/res_a9602.pdf">Resolution A-96-02: A Resolution of the General Assembly of the Puget Sound Regional Council Amending the 1995 Metropolitan Transportation Plan (MTP) and Related Planning Documents to Provide for the Long-Term Commercial Air Transportation Capacity Needs of the Central Puget Sound Region</a>. July 11, 1996\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/decisionprocess.pdf">Summary of the Regional Council's Decision Process Relating to Amending the Metropolitan Transportation Plan to Include a Third Runway at Sea-Tac International Airport with Additional Noise Reduction Measures</a>. June 20, 1996\n  </li>\n</ul>\n<h2>\n  1995\n</h2>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/phase1noise.pdf">Expert Arbitration Panel Order on Phase I Noise Issues</a>. January 9, 1995\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/msasummary.pdf">Major Supplemental Airport Feasibility Study: Summary Report</a>. March 23, 1995\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/phase1order.pdf">Expert Arbitration Panel Final Phase I Order on Demand/System Management Issues</a>. July 27, 1995\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/phase2order.pdf">Expert Arbitration Panel Final Order on Phase II Demand/System Management Issues</a>. December 8, 1995\n  </li>\n</ul>\n<h2>\n  1994\n</h2>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/mou1994.pdf">Memorandum of Understanding. The Federal Aviation Administration, the Washington Department of Transportation, the Puget Sound Regional Council, and the Port of Seattle</a>. March/April 1994\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/painefield.pdf">Why Paine Field Was Eliminated</a>. Memo from Jerry Dinndorf, Director, Growth Management Planning, Puget Sound Regional Council, to the Council's Transportation Policy Board and Growth Management Policy Board. August 31, 1994\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/eb-94-01.pdf">Resolution EB-94-01: A resolution of the Executive Board of the Puget Sound Regional Council ending additional supplemental airport studies</a>. October 27, 1994\n  </li>\n</ul>\n<h2>\n  1993\n</h2>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/a-93-03(apr).pdf">Resolution A-93-03. A Resolution of the General Assembly of the Puget Sound Regional Council Amending the 1988 Interim Regional Airport System Plan (RASP) for Long-Term Commercial Air Transportation Capacity Needs of the Region</a>. April 29, 1993\n  </li>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/a-93-03(aug-sep).pdf">Resolution A-93-03: Implementation Steps</a>. As adopted by the Regional Council Executive Board August 26, 1993 and September 23, 1993\n  </li>\n</ul>\n<h2>\n  1990\n</h2>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/airdocs/noiseabatement.pdf">Final Package of Mediated Noise Abatement Actions for Seattle-Tacoma International Airport agreed to by the Mediation Committee on March 31, 1990</a>\n  </li>\n</ul>\n<p>\n  For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715\n</p>\n	126
145	body	Textile	<p>\n  On July 11, 1996, the Puget Sound Regional Council General Assembly adopted Resolution A-96-02 amending the Metropolitan Transportation Plan (MTP). The resolution added planning for a third runway at Sea-Tac Airport to the MTP and stipulated that several agencies would take steps to reduce the effects of airport noise on communities around the airport. This page provides updates on the Council's current activities related to implementing Resolution A-96-02. For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715.\n</p>\n<ul>\n  <li>Results from the Sea-Tac Airport Community Impact Survey are now available. For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715\n  </li>\n  <li>At its meeting on April 27, 2006 the PSRC Executive Board announced <a href="index.html#">completion of 21 of the 31 action steps</a> [pdf] implementing Resolution A-96-02, narrowed future reporting requirements, instructed staff to collaborate with the Port of Seattle, Highline School District, and WSDOT on the 10 remaining action items, and asked staff to report on further progress each year.\n  </li>\n  <li>The <a href="progress-workshops">9th Annual Air Transportation Progress Workshop</a> was held Thursday January 12, 2006 at the Highline School District Board Room in Burien.\n  </li>\n  <li>The Washington State Legislature has passed a new law related to planning for statewide airport capacity. Engrossed Substitute Senate Bill 5121 (AN ACT Relating to determining long-term air transportation needs) was signed into law by the Governor on May 9. The law sets out a three phase effort to be led by the Washington State Department of Transportation (WSDOT) Aviation Division. Phase I, an assessment of existing airport facility capacity, is to be completed by July 1, 2006. Phase II consists of a statewide market analysis and demand forecast, and must be complete by July 1, 2007. In Phase 3 the Governor will appoint an aviation planning council, who will evaluate the results of phases I and II, and make recommendations as to how best to meet the state's long range airport needs. This phase must be completed by July 1, 2009. The new state law implements the provisions contained in the Regional Council's <a href="index.html#">Resolution EB-04-01</a> [pdf], which encouraged the State to take the lead role in addressing long range air transportation capacity needs.\n  </li>\n  <li>On December 8, 2004 the Executive Board adopted <a href="index.html#">Resolution EB-04-01</a> [pdf] encouraging the State to address long range air transportation capacity needs as they update the Washington Transportation Plan. The resolution reaffirms PSRC's position that the State should take the lead role in addressing long term air transportation capacity. The resolution reiterated that Destination 2030 does not include an additional runway beyond the third runway at Sea-Tac and encouraged the State to begin planning for long range capacity needs. The Executive Board also heard a report on the 8th Annual Air Transportation Progress Workshop on October 20, 2004, where 23 public comments and four written comments were received. Public comments strongly encouraged the commencement of the next round of planning for the region's long term air transportation capacity needs.\n  </li>\n</ul>\n<p>\n  <a href="progress-workshops">Air Transportation Progress Workshops</a>\n</p>\n<p>\n  For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715\n</p>\n	127
146	body	Textile	<p>\n  On July 11, 1996, the Puget Sound Regional Council General Assembly adopted Resolution A-96-02 amending the Metropolitan Transportation Plan (MTP). The resolution added planning for a third runway at Sea-Tac Airport to the MTP, and stipulated in Appendix G of the MTP that several agencies would take steps to reduce the effects of airport noise on communities around the airport. One of the Regional Council's duties under the resolution is to ".... annually convene representatives of the Port of Seattle, FAA, communities affected by airport noise, and other interested parties, to coordinate efforts by all parties to alleviate issues that are undercutting the effectiveness of current noise reduction efforts and eliminate roadblocks to resolving issues, then report on progress to the Executive Board."\n</p>\n<h3>\n  9th Annual Air Transportation Progress Workshop, January 12, 2006\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Progress Reports</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Public Comments</a>\n  </li>\n</ul>\n<h3>\n  8th Annual Air Transportation Progress Workshop, October 20, 2004\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Progress Reports</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Public Comments</a>\n  </li>\n</ul>\n<h3>\n  7th Annual Air Transportation Progress Workshop, October 22, 2003\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Progress Reports</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Action Items Status of Completion Summary</a>\n  </li>\n</ul>\n<h3>\n  6th Annual Air Transportation Progress Workshop, October 22, 2002\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Progress Reports</a>\n  </li>\n</ul>\n<h3>\n  5th Annual Air Transportation Progress Workshop, October 31, 2001\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n</ul>\n<h3>\n  4th Annual Air Transportation Progress Workshop, October 26, 2000\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Progress Reports</a>\n  </li>\n  <li>\n    <a href="progress-workshops#">Public Comments</a>\n  </li>\n</ul>\n<h3>\n  3rd Annual Air Transportation Progress Workshop, August 4, 1999\n</h3>\n<ul>\n  <li>\n    <a href="progress-workshops#">Agenda</a>\n  </li>\n</ul>\n<p>\n  For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715.\n</p>\n	128
147	body	Textile	<p>\n  The Washington State Legislature has passed a new law related to planning for statewide airport capacity. <a href="http://psrctest.cevian.net/transportation/air-transportation/ESSB-5121.pdf">Engrossed Substitute Senate Bill 5121 (AN ACT Relating to determining long-term air transportation needs)</a> was signed into law by the Governor on May 9. The law sets out a three phase effort to be led by the Washington State Department of Transportation (WSDOT) Aviation Division. Phase I, an assessment of existing airport facility capacity, is to be completed by July 1, 2006. Phase II consists of a statewide market analysis and demand forecast, and must be complete by July 1, 2007. In Phase 3 the Governor will appoint an aviation planning council, who will evaluate the results of phases I and II, and make recommendations as to how best to meet the state's long range airport needs. This phase must be completed by July 1, 2009. The new state law implements the provisions contained in the Regional Council's <a href="http://psrctest.cevian.net/transportation/resa9602/res_eb0401.pdf">Resolution EB-04-01</a>, which encouraged the State to take the lead role in addressing long range air transportation capacity needs.\n</p>\n<ul>\n  <li>\n    <a href="http://psrctest.cevian.net/transportation/air-transportation/draftscope.pdf">Preliminary Scope of Work</a> for the study\n  </li>\n  <li>\n    <a href="http://www.wsdot.wa.gov/aviation/LATS.htm">Washington State Long-term Air Transportation Study (LATS)</a>\n  </li>\n</ul>\n<p>\n  For more information, contact Stephen Kiehl, <a href="mailto:skiehl@psrc.org">skiehl@psrc.org</a>, 206-464-6715\n</p>\n	129
148	body	Textile	<p>\n  <img class="imgRight" src="../../images/bikekid.jpg" height="" alt="kid on a bike" width="">The Regional Bicycle Pedestrian Implementation Strategy outlines the specific actions our region should take to turn the non-motorized component of Destination 2030 into reality, and clearly outlines areas of responsibility for city, county, regional, and state agencies, as well as private and non-profit organizations. The Strategy was developed under the guidance of the Bicycle Pedestrian Advisory Committee, and was approved by the Executive Board on July 25, 2002. For more information on the Strategy, contact Kirste Johnson, kjohnson@psrc.org, 206-587-5665.\n</p>\n<h2>\n  Report\n</h2>\n<h3>\n  Regional Bicycle and Pedestrian Implementation Strategy for the Central Puget Sound Region\n</h3>\n<ul>\n  <li>\n    <a href="implementation-strategy#">Full Report</a> [pdf 2.65MB]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Cover, Table of Contents, Executive Summary, Chapter 1: Background</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Cover, Table of Contents, Executive Summary, Chapter 1: Background</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Chapter 2: Regional Context</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Chapter 3: Destination 2030: The Long-Range Plan for Bicycle and Pedestrian Transportation</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Chapter 4: Recommended Strategies to Implement Bicycle and Pedestrian Transportation Systems and Associated Programs</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Chapter 5: Implementation Challenges, Next Steps, List of Acronyms</a> [pdf]\n  </li>\n  <li>\n    <a href="implementation-strategy#">Appendices 1-3:</a> [pdf]\n  </li>\n  <li style="list-style: none">\n    <a href="implementation-strategy#">Appendix 1: Regional Policies Supporting Bicycle and Pedestrian Transportation</a>\n  </li>\n  <li style="list-style: none">\n    <a href="implementation-strategy#">Appendix 2: Examples of Success - Implementation of Bicycle and Pedestrian Projects and Programs in the Central Puget Sound Region</a>\n  </li>\n  <li style="list-style: none">\n    <a href="implementation-strategy#">Appendix 3: Summary Capital Facility Development Guidance</a>\n  </li>\n  <li>\n    <a href="implementation-strategy#">Appendix 4: Matrix of Recommended Actions and Agency Responsibilities</a> [pdf]\n  </li>\n</ul>\n	131
150	body	Textile	<h2>\n  Destination 2030\n</h2>\n<p>\n  <img class="imgRight" src="../../images/wlakeped.jpg" height="" alt="pedestrians" width="">Destination 2030, adopted in May 2001, is the transportation component of VISION 2020 and includes provisions that link land use and transportation planning. The regional non-motorized system detailed in Destination 2030 calls for a significantly increased investment in facilities and programs that support pedestrian and bicycle travel, and was developed under the guidance of the regional Bicycle/Pedestrian Advisory Committee.\n</p>\n<p>\n  For the purpose of regional planning, a definition was created to capture the bicycle and pedestrian facilities that are truly regional in nature.\n</p>\n<h3>\n  The regional non-motorized network is focused on facilities that:\n</h3>\n<ul>\n  <li>Fill gaps in the existing non-motorized network\n  </li>\n  <li>Create connections to, and improve circulation within, urban centers\n  </li>\n  <li>Link to regional transit stations, creating seamless intermodal connections\n  </li>\n</ul>\n<p>\n  Types of regional facilities include shared-use bicycle/pedestrian paths, bike lanes, and a number of pedestrian improvements, including sidewalks, walkways, crosswalks, and various traffic-calming measures.\n</p>\n<h3>\n  The regional non-motorized investments outlined in Destination 2030 include:\n</h3>\n<ul>\n  <li>More than 2,000 miles of new paths and bike lanes by 2030\n  </li>\n  <li>5 commuter bicycle stations\n  </li>\n  <li>Pedestrian improvements in the zones of urban centers and transit stations\n  </li>\n</ul>\n<h3>\n  Destination 2030 Documents\n</h3>\n<ul>\n  <li>\n    <a href="long-range-planning#">Map: Metropolitan Transportation System Non-Motorized Component</a> [pdf]\n  </li>\n  <li>\n    <a href="long-range-planning#">Map: Regional Non-motorized Improvements: 2001-2010</a> [pdf]\n  </li>\n  <li>\n    <a href="long-range-planning#">Map: Regional Non-motorized Improvements: 2011-2030</a> [pdf]\n  </li>\n  <li>\n    <a href="long-range-planning#">Destination 2030 Project List - Non-motorized</a> [pdf]\n  </li>\n</ul>\n<h2>\n  VISION 2020\n</h2>\n<p>\n  VISION 2020, adopted in 1995, is the regional growth, transportation and economic strategy which calls for preserving and developing compact communities, redeveloping urban transportation corridors, and directing employment and housing growth into centers that support walking, biking, and transit use. Many of the adopted regional policies in VISION 2020 support the development of a comprehensive regional bicycle and pedestrian network.\n</p>\n	132
265	body	Textile	Rocky Piro, Growth Management Program Manager at PSRC, has been honored by the Washington Chapter of the American Planning Association for his contribution towards the advancement of the planning profession. Rocky was honored for his role in the development of VISION 2040, his work as a Planning Commissioner for the City of Shoreline, and his service as board member for the APA's Regional and Intergovernmental Planning Division. \r\n	202
156	body	Textile	<p>\n  This is a complex question. Ultimately, determining fairness depends upon a number of factors including how a pricing policy could improve upon an existing system that may already contain elements of unfairness.\n</p>\n<p>\n  The economic principle underlying the toll rates recognizes that each user tends to consider only their own time and "out-of-pocket" monetary costs of travel (private costs), and not the costs that their travel imposes on everyone else traveling in the system (external costs). If each user in the system faced a toll equal to the external cost they impose on other users, roadway capacity would be more efficiently allocated, and the over-consumption leading to congestion due to the inexact price or cost signals would be much less prevalent.\n</p>\n<p>\n  Fairness will depend upon how variable pricing is used, and what happens with the revenues that would be collected. A direct fee to use congested roadways assesses costs according to those who are responsible for the costs. In this sense the pay to use concept is fair. However, variable pricing, like many utility type charges, does not always reflect an individual's ability to pay.\n</p>\n<p>\n  To the extent that revenues are used to improve transit and roadway capacity, broad users may share the benefits. In theory, those with more flexibility in their schedules would be less affected than drivers with little flexibility in their work schedules. Once again, the key is improving travel choices. In Orange County, where drivers can chose to pay to access HOT lanes, there was significant usage of the toll facility by individuals at all income levels.\n</p>\n<p>\n  Conversely, if variable pricing cut congestion by 10-40% - as evidenced elsewhere - many of those no longer traveling cannot simply travel later or stay at home! A good percentage will still need to get to work - by transit, carpool, or other means. If alternatives are not available, commuters will return to their previous travel patterns and pricing will become a significant hardship.\n</p>\n<p>\n  These are some of the important aspects of fairness that will be better understood through the research study.\n</p>\n	138
157	body	Textile	<p>\n  The operational portion of the project was completed in the spring of 2006. During the project, the toll systems were in operation for over 18 months. The project fielded hundreds of customer service calls, issued over 4,000 billing invoices, logged over 100,000 data transactions to the central system, and recorded over 750,000 individual participant trip records. The project is the first large-scale operational test showing the feasibility of area-wide road use and congestion-based charging.\n</p>\n<p>\n  A primary objective of this research is to develop a better empirical understanding of price elasticity of demand for road use, when tolls are applied within a broad geography with high-resolution road network scale. Preliminary analysis estimates short-run demand elasticities in the range of -0.12, which translates into approximately 10% reduction in vehicle use during peak travel times, with considerably more traffic reduction on specific facilities. Results suggest there is a very real opportunity to reduce wasted time resources and convert them to significant revenues for investment. Detailed analysis of the behavior data will continue over the next year and beyond. To date the project has contributed significantly to knowledge related to the application of road use charging.\n</p>\n<p>\n  This approach to road tolling introduces a number of technical and policy issues that require additional analysis. Key findings and lessons for future installations of GPS based tolling systems include:\n</p>\n<ul>\n  <li>Broad-based tolling of highway and arterial facilities can result in significant changes in driver behavior, and offers opportunities to develop a viable and more rational approach to roadway finance.\n  </li>\n  <li>The selected technology is mature. The experience with an off-the-shelf solution has been very successful.\n  </li>\n  <li>Physical installation of the metering devices in participant vehicles was a significant logistical challenge. The project equipped over 400 participant vehicles; at a large scale of deployment, the installation logistics would be a central issue in program design.\n  </li>\n  <li>Privacy will continue to be a notable area of policy concern, but one that can be managed through both technical and institutional approaches.\n  </li>\n  <li>An operational program where GPS-based tolling is at its core will require robust verification and enforcement components\n  </li>\n  <li>The costs of employing a dedicated device for GPS toll applications are currently high, but the costs are rapidly decreasing with technical advances. The current project was not focused on testing the feasibility of any particular business model.\n  </li>\n</ul>\n<p>\n  More detailed results will be reported back on this website and to the PSRC and Federal Highway Administration as they become available. Project results may influence discussions about how to manage congestion and fund transportation improvements in the future.\n</p>\n	139
