419	body	Textile	<p><b>SEATTLE&#151;</b>&nbsp; \r\nThe Puget Sound Regional Council Transportation Policy Board has released for public comment a diverse group of special needs transportation projects recommended to receive $2 million in federal funding and a regionally prioritized list of projects that will apply for WSDOT Public Transportation Consolidated Grant funding. These projects are designed to provide transportation service, create or maintain an infrastructure for coordinated planning, or provide training and educational resources for individuals with special transportation needs. Each of the projects supports the regions strategic goals and objectives of putting people first, moving people efficiently, and moving more people; found in the Coordinated Transit-Human Services Transportation Plan.\r\n<p>\r\nDefined by state law, those with special needs are individuals and their attendants that, due to mental or physical disability, income status, or age, are unable to transport themselves or purchase appropriate transportation services.  Each project plays an important role in the mobility of these populations or the coordination of special needs transportation services.  \r\n<p>\r\n<strong>Examples of projects recommended for funding include:</strong><p></p>\r\n<ul>\r\n<li><strong>Beyond the Borders</strong> - Uses paratransit services to coordinate and schedule trips for special needs populations to and from rural Pierce County.  Recommended award: $275,725\r\n<li><strong>Road to Independence</strong> - Driver training to low income drivers who in turn provide transportation services to low income, elderly, and disabled populations.  Recommended award: $173,032\r\n\r\n<li><strong>Snohomish County Special Needs Transportation Hotline</strong> - Maintain a one-stop call center for transportation information and referral in Snohomish county.  Recommended award: $67,994\r\n<li><strong>Hyde Shuttle</strong> - Small community based paratransit operation serving special needs populations in Seattle's First Hill, Capitol Hill, Central Area, International District, and West Seattle Neighborhoods.  Recommend award: $344,260\r\n<li><strong>SR 99 late night and weekend Bus Rapid Transit (SWIFT)</strong> - Late night and weekend service along SR-99 between Everett Station and Aurora transit center (scheduled to begin in Nov. 2009).  Recommended award: $400,000\r\n<li><strong>Snohomish Co. Special Needs Transportation Coalition (SNOTRAC), Mobility Management </strong>- Manage ongoing tasks of SNOTRAC and carry out SNOTRAC's plan by building partnerships with community transportation and human service providers.  Recommended award: $126,925 \r\n</ul>\r\n<p>\r\nA "complete list of the 23 projects":/funding/jarc and detailed project descriptions are available online at psrc.org. </a>\r\n<p>*PSRC Coordinated Transit - Human Service Transportation Plan*\r\nThe funds are derived from two Federal Transit Administration sources available via the PSRC: Job Access Reverse Commute (JARC), and New Freedom. The projects are not required to be modeled for air quality conformity. \r\n<p>\r\n\r\nWritten comments will be accepted until December 29 and included in the agenda packet for the Transportation Policy Board meeting on January 8, when it finalizes its recommendation to the Executive Board. Comments can also be made in person at the Transportation Policy Board meeting on December 11 or January 8, as well as the Executive Board meeting on January 22, when the draft program of JARC and New Freedom projects is scheduled for final approval and the regional prioritized list of projects applying for states funds is submitted to WSDOT.\r\n<p>\r\n<strong>How to Make a Comment:</strong>\r\n<ul>\r\n<li>E-mail: <a href="mailto:mlawlor@psrc.org">mlawlor@psrc.org</a>\r\n<li>Mail: \r\nPuget Sound Regional Council<br>\r\nATTN: Mary Pat Lawlor<br>\r\n1011 Western Avenue, Suite 500<br>\r\nSeattle, Washington 98104-1035<br>\r\n\r\n<li>Phone: 206-971-3272\r\n<li>In Person: Dec. 11, Jan. 8 or Jan. 22 at PSRC (Boardroom) \r\n</ul>\r\n<p>\r\nPSRC develops policies and coordinates decisions about regional growth and transportation planning in King, Pierce, Snohomish and Kitsap counties. The Council is composed of over 80 county, city, port, transit, tribal and state agencies serving the region. It coordinates the distribution of about $160 million in Federal Highway Administration and Federal Transit Administration funds each year. PSRC sets priorities and evaluates the most efficient ways to target those funds to support state and local transportation and growth management plans. \r\n<p>\r\nThis public notice of public involvement activities and time established for public review and comments on the TIP development process will satisfy the FTA's Program of Projects requirements.\r\n\r\n<p>\r\nTitle VI Notice: PSRC fully complies with Title VI of the Civil Rights Act of 1964 and related statutes and regulations in all programs and activities. For more information, or to obtain a Title VI Complaint Form, contact PSRC at 206-587-4819 or "download one":/public/titlevi online.	235
