/visual aids are provided?</label>\n    </div>\n    <div>\n      <textarea name="12.av_aids" id="12.av_aids" rows="3" cols="60">\n</textarea>\n    </div>\n    <div>\n      <input type="submit" value="Submit">\n    </div>\n  </fieldset>\n</form>\n<p>\n  <strong>Please mail any other information, including a tentative agenda to:</strong>\n</p>\n<ul>\n  <li>Sylvia Nelson\n  </li>\n  <li>Puget Sound Regional Council\n  </li>\n  <li>1011 Western Avenue, Suite 500\n  </li>\n  <li>Seattle, Washington 98104\n  </li>\n</ul>\n<p>\n  If you have questions, please contact Sylvia Nelson, <a href="mailto:snelson@psrc.org">snelson@psrc.org</a>, 206-464-7518.\n</p>\n	154
