196	body	Textile	<p>\n  As amended March 16, 2000\n</p>\n<h2>\n  ARTICLE I\n</h2>\n<h3>\n  Purpose\n</h3>\n<p>\n  The purpose of the Puget Sound Regional Council, shall be to exercise the authority delegated to it pursuant to the Interlocal Agreement and under federal and state laws as the Metropolitan Planning Organization and Regional Transportation Planning Organization for the central Puget Sound region, and to qualify eligible agencies for programming of federal, state and local transportation projects identified in the Transportation Improvement Program.\n</p>\n<h2>\n  ARTICLE II\n</h2>\n<h3>\n  Organization\n</h3>\n<p>\n  The agency shall be organized into a General Assembly, consisting of all voting member agencies, including King, Kitsap, Pierce, and Snohomish counties, the cities and towns within those counties that are signatories to the Interlocal Agreement, and the statutory members of the organization; an Executive Board of representatives of the voting members; and policy boards and committees as established by the Executive Board.\n</p>\n<p>\n  <strong>Section 1.</strong> Representation in the General Assembly of the Puget Sound Regional Council shall consist of elected officials from the voting member agencies and representatives of the statutory members, as defined in the Interlocal Agreement.\n</p>\n<p>\n  <strong>Section 2.</strong> Except as hereinafter provided by these Bylaws, the Executive Board shall carry out all delegated powers and managerial and administrative responsibilities between the meetings of the General Assembly.\n</p>\n<h2>\n  ARTICLE III\n</h2>\n<h3>\n  Officers\n</h3>\n<p>\n  <strong>Section 1.</strong> The officers of the Puget Sound Regional Council shall be a President and Vice President.\n</p>\n<p>\n  <strong>Section 2.</strong> Elections: The President and Vice President of the Puget Sound Regional Council shall be elected by the General Assembly from the Executive Board membership, and shall not be from the same county. Nomination of candidates for the offices of President and Vice President shall be presented annually to the General Assembly, at its first meeting of the calendar year, for the General Assembly's action.\n</p>\n<p>\n  <strong>Section 3.</strong> Term: The President and Vice President shall serve for one year and their terms of office shall begin at the close of the annual meeting at which they are elected. In the event of a vacancy in the office of the President, the Vice President shall succeed to said office for the unexpired portion of the term. In the event there is a vacancy in the office of the Vice President, the President shall appoint a new Vice President for the unexpired portion of the term.\n</p>\n<p>\n  In the event there is a vacancy in the office of the President and Vice President, the Executive Board shall elect from its membership a new President and Vice President to serve the unexpired portion of the terms.\n</p>\n<p>\n  <strong>Section 4.</strong> At least two months in advance of the annual meeting of the General Assembly, the President shall appoint a nominating committee composed of one representative from each county, one representative from the cities and towns in each county, and one representative from the statutory members. The committee shall nominate candidates for the offices of President and Vice President. Such nominations shall be presented to the Assembly at its annual meeting for the Assembly's action. Additional candidates may be nominated at the same meeting by any regular member.\n</p>\n<h2>\n  ARTICLE IV\n</h2>\n<h3>\n  Duties of Officers\n</h3>\n<p>\n  <strong>Section 1.</strong> President. The President shall conduct the annual meeting of the General Assembly and the meetings of the Executive Board, and shall be responsible for the preparation of the agenda for said meetings. The President shall ensure that the functions of the Puget Sound Regional Council are carried out to the best of his or her ability. The President shall have the responsibility to direct the Executive Director and the staff, and shall make such reports as needed.\n</p>\n<p>\n  <strong>Section 2.</strong> Vice President. The Vice President shall preside and perform the duties of the President in the absence of the President. The Vice President shall serve also as Vice President of the Executive Board, and will chair the Operations Committee.\n</p>\n<h2>\n  ARTICLE V\n</h2>\n<h3>\n  The General Assembly\n</h3>\n<p>\n  <strong>Section 1.</strong> Meeting Date: The General Assembly of the Puget Sound Regional Council shall meet at least annually, at a time and place designated by the Executive Board.\n</p>\n<p>\n  <strong>Section 2.</strong> Composition: The General Assembly shall be composed of all voting member agencies, including statutory members and member Tribal governments, as provided for in the Interlocal Agreement. Member counties, cities, towns, ports and Tribal governments shall be represented in the General Assembly by elected officials from their executive and legislative branches. Statutory members that do not have elected officials on their governing body shall designate their representatives.\n</p>\n<p>\n  <strong>Section 3.</strong> Notice: Written notice and the agenda of all General Assembly meetings shall be delivered or mailed to all member agencies and statutory members at least ten days prior to the meeting; provided, however, that if the President or Executive Board determines that an emergency exists, either may make a written finding to that effect, in which event a meeting may be held on written notice delivered to each member at least three work days before the meeting; and, provided further, that a member may waive notice of the meeting by written instrument filed with the Executive Board.\n</p>\n<p>\n  <strong>Section 4.</strong> Purpose: The purpose of the General Assembly will be to adopt or amend a regional transportation plan, regional growth management strategy or Bylaws, to adopt an annual work program and budget, to elect a President and Vice President, and to take action on such other matters as the Executive Board or the President may determine.\n</p>\n<p>\n  <strong>Section 5.</strong> Quorum: A quorum of the General Assembly shall be one-half of the member jurisdictions, provided that the agencies making up such a quorum shall represent at least 50 percent of the regional population.\n</p>\n<p>\n  <strong>Section 6.</strong> Voting: The General Assembly shall make decisions when a quorum is present, and on the basis of a weighted vote of the members, with the weight of each city and county jurisdiction's vote as follows: total votes of all city and county jurisdictions within each county will be proportional to each county's share of the regional population. County government will be entitled to fifty percent (50%) of their respective county's total vote. City and town votes will be based on their respective share of the total incorporated population of their county. The Tribal representatives' vote will be based on their respective share of the region's population. Representatives present shall cast the jurisdiction's total weighted votes, and may split their vote as they choose.\n</p>\n<p>\n  The vote of statutory members shall be as prescribed in the applicable statute or as determined by the Executive Board where the applicable statute is silent on the matter of voting. Except as specified in Article V, Section 7 hereof, action on all matters coming before the Assembly shall require a simple majority of the votes cast on the issue and the manner of voting shall be determined by the presiding officer; except that a roll call vote shall be taken upon the request of any two regular members.\n</p>\n<p>\n  <strong>Section 7.</strong> Voting: The following matters calling for General Assembly action shall be the subject of a roll call vote and shall require the affirmative vote of two-thirds (2/3) of those present and voting on the matter, and the prevailing vote shall be in conformance with the provisions of Article V, Section 6:\n</p>\n<ul>\n  <li>a) Approval of the annual work program and budget;\n  </li>\n  <li>b) Adoption or amendment of a regional growth management strategy;\n  </li>\n  <li>c) Adoption or amendment of a regional transportation plan; and\n  </li>\n  <li>d) Amendment of these Bylaws.\n  </li>\n</ul>\n<h2>\n  ARTICLE VI\n</h2>\n<h3>\n  The Executive Board\n</h3>\n<p>\n  <strong>Section 1.</strong> Meeting Dates: The Executive Board shall designate a date and time for its meetings. Additional meetings may be held upon request of the President, or upon the request of two Board members, providing those members are from different counties.\n</p>\n<p>\n  <strong>Section 2.</strong> Composition: The Executive Board shall be composed of elected officials representing member agencies and representatives of statutory members as determined in the Interlocal Agreement.\n</p>\n<p>\n  <strong>Section 3.</strong> Appointment: Representatives to the Executive Board shall be appointed as follows:\n</p>\n<ul>\n  <li>a) For each county, and for the cities of Everett, Seattle and Tacoma, which are permanently assigned positions on the Executive Board pursuant to the Interlocal Agreement, and for statutory members, the method of appointment is at the discretion of the appointing jurisdiction or agency.\n  </li>\n  <li>b) For the remaining member cities and towns in each county, the method of appointment is at the discretion of the members immediately concerned. Should the members immediately concerned not agree on a method of appointment, any one member concerned may request initiation of a dispute resolution process. Once the dispute resolution process has been initiated, the members concerned shall for thirty (30) days seek a mutually acceptable accommodation of their differences among themselves, or when requested by any member concerned, with the assistance of an independent intervener or third party appointed by the Executive Board. After thirty (30) days has passed, the dispute resolution process will be deemed resolved when a weighted vote of the applicable members show that members representing two-thirds (2/3) of the represented population agree to a particular method of appointment. The method chosen must not place additional requirements, beyond those enumerated in the Bylaws or Interlocal Agreement, on members prior to consideration for or service on the Executive Board.\n  </li>\n  <li>c) Except in the case of statutory members which have no elected officials on their governing body, each Executive Board member shall be an elected official. Each Executive Board member must have one designated alternate who shall have all powers and privileges of the representative. The alternate for each elected official must also be an elected official. Appointment of Executive Board members and alternates from statutory members which have no elected officials shall be at the discretion of the head of the agency.\n  </li>\n  <li>d) The name, address and phone number of all Executive Board members and their designated alternates shall be filed in writing with the Executive Board.\n  </li>\n</ul>\n<p>\n  <strong>Section 4.</strong> Notice: Agenda with supporting materials shall be mailed at least seven (7) days in advance of all regularly scheduled meetings; however, if the President or Executive Board determines that an emergency exists, either may make a finding to that effect, in which event a special meeting may be held, provided that notice in writing, or via telephone or FAX, is delivered to each Board member at least three (3) work days in advance. The agenda for a special meeting shall be limited to those items specified in the notice.\n</p>\n<p>\n  <strong>Section 5.</strong> Purpose: The purpose of the Executive Board shall be to direct the affairs of the Puget Sound Regional Council between the annual meetings of the General Assembly. The Executive Board shall exercise on behalf of the Puget Sound Regional Council all delegated powers and managerial and administrative authority. The Executive Board shall appoint and remove the Executive Director.\n</p>\n<p>\n  <strong>Section 6.</strong> Quorum: A simple majority of members of the Executive Board shall constitute a quorum.\n</p>\n<p>\n  <strong>Section 7.</strong> Voting: The Executive Board shall make decisions when a quorum is present and on the basis of a weighted vote of the members, with the weight of each city and county jurisdiction's vote as follows: total votes of all city and county jurisdictions within each county will be proportional to each county's share of the regional population. County government will be entitled to fifty percent (50%) of their respective county's total vote. City and town votes will be based on their respective share of the total incorporated population of their county. Statutory membership and voting rights shall be determined by the applicable statute or by the Executive Board where the statute is silent on the matter of voting. Membership and votes for county and city jurisdictions represented on the Board will be proportional to the total population within the regional agency's jurisdiction.\n</p>\n<p>\n  <strong>Section 8.</strong> All actions of the Executive Board shall be by majority vote unless otherwise provided by law or in these Bylaws, and shall be taken at the regular or special meetings of the Executive Board as provided for by these Bylaws.\n</p>\n<p>\n  <strong>Section 9.</strong> Voting: A two-thirds (2/3) majority vote may be called for if the board members representing a county, the largest city within that county, and the other cities and towns within that county, unanimously call for a two-thirds vote. When a simple majority is required on a vote, it shall be one-half (1/2) plus one of those present and voting. When a two-thirds (2/3) majority is required, it shall be a two-thirds (2/3) majority of those present and voting.\n</p>\n<p>\n  <strong>Section 10.</strong> Pursuant to the Interlocal Agreement, and to applicable state and federal laws, a Transportation Policy Board and a Growth Management Policy Board shall be established to advise the Executive Board on regional transportation and growth management issues, and on any other matters as directed by the Executive Board. Membership on the boards shall be consistent with the Interlocal Agreement, federal and state requirements, and direction provided by the Executive Board. The Chairpersons and voting structure of the Policy Boards shall be recommended by the President to the Executive Board for approval.\n</p>\n<p>\n  <strong>Section 11.</strong> Committees: The President may appoint or the Executive Board may require the President to appoint ad hoc or standing Executive Board committees to advise or assist the Board in its function. Ad hoc Executive Board Committees shall have a specific charge, within a given time frame, with a required and stated product, and shall cease to exist after their function is performed. The Chairperson and other members of all Executive Board committees shall be recommended by the President to the Executive Board for approval and membership of such committees may include elected officials, local government staffs, citizens, professionals in the field, or other experts.\n</p>\n<p>\n  <strong>Section 12.</strong> Associate Members. Any jurisdiction of general purpose government not a party to the Interlocal Agreement, and any jurisdiction of special purpose government within the four-county region, may be admitted to associate membership at the direction of the Executive Board. Associate members may serve on the policy boards and committees or subcommittees of the Executive Board at the Executive Board's discretion.\n</p>\n<h2>\n  ARTICLE VII\n</h2>\n<h3>\n  Executive Director\n</h3>\n<p>\n  The Executive Director shall be appointed or removed by the Executive Board. The Executive Director shall have the following duties and responsibilities:\n</p>\n<p>\n  <strong>Section 1.</strong> The Executive Director shall be responsible for overall supervision and management of the business of the Puget Sound Regional Council including, without limitation of the foregoing: keeping a written record of all actions of the Assembly or the Executive Board; receiving monies payable to the Puget Sound Regional Council and disbursement thereof as authorized by the Assembly or the Executive Board; maintaining accurate and complete accounts of all receipts and disbursements; supervising all studies and programs authorized by the Puget Sound Regional Council; supervising all staff, including the hiring and firing of staff; and performing such other duties as may be assigned to the Executive Director from time to time by the General Assembly, the Executive Board, or the President.\n</p>\n<p>\n  <strong>Section 2.</strong> The Executive Director shall have authority to execute contracts in the name of the Puget Sound Regional Council which are in conformance with the approved work program and budget and which are in the amount of ten thousand dollars ($10,000) or less without the prior approval of the Executive Board. Upon execution of such contracts, the Executive Director shall notify the President and such committees as the Executive Board may prescribe from time to time. A contract in which the Puget Sound Regional Council is party and which is in the amount of greater than ten thousand dollars ($10,000) shall require the prior approval of the Executive Board before execution by the Executive Director.\n</p>\n<p>\n  <strong>Section 3.</strong> The Executive Director shall prepare, under direction of the Executive Board or committee thereof, an annual work program and budget.\n</p>\n<h2>\n  ARTICLE VIII\n</h2>\n<h3>\n  Work Program and Budget\n</h3>\n<p>\n  <strong>Section 1.</strong> The work program and budget shall be presented to the Executive Board for review, revision, and adoption before being presented to the General Assembly.\n</p>\n<p>\n  <strong>Section 2.</strong> The General Assembly shall adopt the final work program and budget.\n</p>\n<p>\n  <strong>Section 3.</strong> The Executive Board shall control all expenditures in accordance with the adopted work program and budget and shall have the power to amend the work program and budget to meet unanticipated needs or changed conditions.\n</p>\n<h2>\n  ARTICLE IX\n</h2>\n<h3>\n  Public Participation\n</h3>\n<p>\n  The Agency shall seek involvement in its planning process of the general public, community and neighborhood organizations in urban and rural areas, large and small private sector interests, and local, regional and state government.\n</p>\n<p>\n  <strong>Section 1.</strong> The Agency shall establish a citizen participation plan providing for early and continuous public participation in the development and amendment of the regional transportation plan and regional growth management strategy.\n</p>\n<p>\n  <strong>Section 2.</strong> The plan shall cover a broad range of public information and participation opportunities, including dissemination of proposals and alternatives, process for written comments, public meetings after effective notice, settings for open discussion, communication programs, information services, and consideration of and response to public comments.\n</p>\n<h2>\n  ARTICLE X\n</h2>\n<h3>\n  Open Meetings\n</h3>\n<p>\n  To ensure appropriate notice, public involvement, and effective regional decision-making, all meetings of the Regional Council will be conducted consistent with the Council's adopted Public Participation Plan, as provided for in Article IX of these Bylaws. In addition, the Council will ensure that, at a minimum, the specific meetings noted below, in Section 1 of Article X, are conducted in accordance with the state Open Public Meetings Act.\n</p>\n<p>\n  <strong>Section 1.</strong> All meetings of the General Assembly, Executive Board, Operations Committee, Transportation Policy Board, and Growth Management Policy Board shall conform to the Open Public Meetings Act, RCW 42.30. The Executive Board shall adopt procedures to ensure appropriate notice of all meetings of the Regional Council.\n</p>\n<h2>\n  ARTICLE XI\n</h2>\n<h3>\n  Parliamentary Authority\n</h3>\n<p>\n  The rules contained in the current edition of Robert's Rules of Order Newly Revised shall govern the Assembly and the Executive Board in all cases to which they are applicable and in which they are not inconsistent with these Bylaws or any special rules of order the Assembly or the Executive Board may adopt.\n</p>\n<h2>\n  ARTICLE XII\n</h2>\n<h3>\n  Amendments to Bylaws\n</h3>\n<p>\n  These Bylaws may be amended at any regular or special meeting of the General Assembly by a two-thirds (2/3) majority vote, in conformance with the provisions of Article V, Section 6 hereof, of those present and voting; provided, however, that a copy of the proposed amendment has been mailed to each regular member at least fifteen (15) days prior to the meeting at which the vote to amend is taken.\n</p>\n<p>\n  <strong>ADOPTED</strong> by the General Assembly of the Puget Sound Regional Council on the 30th day of September, 1991.\n</p>\n<p>\n  <strong>AMENDED</strong> by the General Assembly of the Puget Sound Regional Council on the 11th day of March, 1993.\n</p>\n<p>\n  <strong>AMENDED</strong> by the General Assembly of the Puget Sound Regional Council on the 25th day of May, 1995.\n</p>\n<p>\n  <strong>AMENDED</strong> by the General Assembly of the Puget Sound Regional Council on the 19th day of March, 1998.\n</p>\n<p>\n  <strong>AMENDED</strong> by the General Assembly of the Puget Sound Regional Council on the 16th day of March, 2000.\n</p>\n	158
