206	body	Textile	PSRC publications are available free of charge from the Information Center and are distributed to local area libraries. This list includes the most current and most popular publications, most of which are available to download. Please complete this <a href="request">publication request form</a> if you are unable to find a publication you need, or contact the Information Center directly.\r\n\r\n<r:find url="/about/infoctr/publications/">\r\n  <r:children:each order="asc" sort="title">  \r\n    h3. <r:link />\r\n\r\n    <r:content /> \r\n  </r:children:each>\r\n</r:find>\r\n\r\n	166
194	body	Textile	The PSRC Information Center is a clearinghouse for regional data and publications on population, housing, economy, and transportation in the central Puget Sound region. We collect comprehensive plans and EIS documents from area jurisdictions, and Census publications, books, and journals pertinent to PSRC work areas. The public is welcome to come in and view our collection; however, library items are for staff checkout only. Older publications or print copies may be ordered from the Information Center.\r\n\r\n*(spaced) "Services We Offer":/about/infoctr/services\r\n* "Publications":/about/infoctr/publications\r\n* "Administrative Documents":/about/infoctr/admin-docs\r\n* "Public Records Request":/about/infoctr/records-request\r\n* "Relevant Links":/about/infoctr/links\r\n	156
