222	body	Textile	<p>\r\n  Board members are appointed by their General Assembly constituents to represent the member governments. The Board is chaired by the Regional Council president, meets monthly and carries out delegated powers and responsibilities between meetings of the General Assembly.\r\n</p>\r\n<div class="officers">\r\n  <img src="../../images/officers-ladenburg.jpg" height="140" alt="John W. Ladenburg" width="100">\r\n  <p>\r\n    John W. Ladenburg\r\n    <br>\r\n    President\r\n  </p>\r\n</div>\r\n<div class="officers">\r\n  <img src="../../images/officers-singer.jpg" height="140" alt="Sue Singer" width="100">\r\n  <p>\r\n    Sue Singer\r\n    <br>\r\n    Vice President\r\n  </p>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Next Meeting\r\n  </h2>\r\n  <ul>\r\n    <li>\r\n      <strong>February 22, 2007 - 10-11:30 a.m.</strong>\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n    <li>Contact: Sylvia Nelson, 206-464-7518.\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Past Meetings\r\n  </h2>\r\n  <ul>\r\n    <li>\r\n      <a href="../pdf/ebagenda012507.pdf">January 25th, 2007 Agenda</a> [pdf]\r\n    </li>\r\n    <li>\r\n      <a href="../minutes">Minutes of Past Meetings</a>\r\n    </li>\r\n    <li>\r\n      <a href="../at-work">Summaries of Past Meetings</a>\r\n    </li>\r\n  </ul>\r\n</div>\r\n<h2>\r\n  Composition &amp; Membership\r\n</h2>\r\n<table class="compMember" cellspacing="0" border="0" width="100%" cellpadding="0">\r\n  <tr>\r\n    <th colspan="3">\r\n      King County/Cities (15)\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <td colspan="3"></td>\r\n  </tr>\r\n  <tr>\r\n    <td class="location" rowspan="4">\r\n      King County (2)\r\n    </td>\r\n    <td>\r\n      Executive Ron Sims\r\n    </td>\r\n    <td>\r\n      206-296-4040\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td>\r\n      Councilmember Julia Patterson\r\n    </td>\r\n    <td>\r\n      206-296-1013\r\n    </td>\r\n  </tr>\r\