221	body	Textile	<p>\r\n  <a href="http://www.prosperitypartnership.org/"><img class="imgRight" src="../images/pp-logo.jpg"></a>The regional Economic Development District (EDD) is the federally designated economic development district for the central Puget Sound Region covering King, Kitsap, Pierce, and Snohomish counties. The EDD is responsible for regional economic development planning and collaborates with various private and public sector agencies to accomplish this goal. The EDD brings together the private and public sectors in a partnership necessary to provide a coordinated strategy and an ongoing economic development program for the region.\r\n</p>\r\n<div class="officers">\r\n  <img src="../images/officers-knutson.jpg" height="140" alt="Deborah Knutson" width="100">\r\n  <p>\r\n    Deborah Knutson, Snohomish Co.\r\n    <br>\r\n    Economic Development Council, President\r\n  </p>\r\n</div>\r\n<div class="officers">\r\n  <img src="../images/officers-della.jpg" height="140" alt="David Della" width="100">\r\n  <p>\r\n    Councilmember David Della, Seattle\r\n    <br>\r\n    Vice President\r\n  </p>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Next Meeting\r\n  </h2>\r\n  <ul>\r\n    <li>February 14, 2007 - 2-4 p.m.\r\n    </li>\r\n    <li>Regional Council Board Room\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n    <li>\r\n      <a href="pdf/agendapacket020807.pdf">Agenda for this meeting</a>\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Past Meetings\r\n  </h2>\r\n  <ul>\r\n    <li>\r\n      <a href="pdf/edd_agenda_011007.pdf">Agenda for meeting held January 10th, 2007</a> [pdf]\r\n    </li>\r\n    <li>\r\n      <a href="minutes">Minutes - Past Executive Board Meetings</a>\r\n    </li>\r\n    <li>\r\n      <a href="at-work">At Work - Summaries of Past Executive Board Meetings</a>\r\n    </li>\r\n  </ul>\r\n</div>\r\n<h2>\r\n  Composition &amp; Membership\r\n</h2>\r\n<table class="compMember" cells