226	body	Textile	<a name="rsc"></a>\r\n<h2>\r\n  Regional Staff Committee\r\n</h2>\r\n<p>\r\n  The Regional Staff Committee, which includes high-level staff from member jurisdictions and transit agencies, in approximate proportion to representation on the Executive Board, discusses key issues and may make recommendations to the policy boards, Operations Committee, and Executive Board.\r\n</p>\r\n<p>\r\n  <a href="other#">Regional Staff Committee Member List</a>\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Thursday, February 15th, 2007\r\n      <br>\r\n      9:30 a.m. - 12:00 noon\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n    <li>\r\n      <a href="pdf/rsc_agenda_021507.pdf">Agenda for this meeting</a> [pdf]\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Megan Marston\r\n      <br>\r\n      206-389-2877\r\n      <br>\r\n      mmarston@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="rpec"></a>\r\n<h2>\r\n  Regional Project Evaluation Committee (RPEC)\r\n</h2>\r\n<p>\r\n  The Regional Project Evaluation Committee includes public works directors, representatives from transit agencies, the Governor's office, and WSDOT district offices. Makes recommendations on criteria and specific projects for federal funding and deal with related transportation planning issues.\r\n</p>\r\n<p>\r\n  <a href="other#">Regional Project Evaluation Committee Member List</a>\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Thursday, March 23rd, 2007\r\n      <br>\r\n      9:30 - 11:00 a.m.\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Libby Parham\r\n      <br>\r\n      206-389-2159\r\n      <br>\r\n      lparham@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="tec"></a>\r\n<h2>\r\n  Transportation Enhancements Committee\r\n</h2>\r\n<p>\r\n  The Transportation Enhancements Committee is a citizens committee created by the Transportation Policy Board to prioritize projects for the statewide enhancements competition. Members represent the different interests of the enhancement categories. Meetings are held during the annual statewide enhancement cycle.\r\n</p>\r\n<p>\r\n  <a href="other#">Transportation Enhancements Committee Member List</a>\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>To Be Announced\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Kelly McGourty\r\n      <br>\r\n      206-464-7892\r\n      <br>\r\n      kmcgourty@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="rtf"></a>\r\n<h2>\r\n  Regional Technical Forum\r\n</h2>\r\n<p>\r\n  The Regional Technical Forum includes technical staff from Council members, and others interested in technical issues are invited to attend. Working groups on specific topics meet periodically.\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Insert date\r\n      <br>\r\n      Insert time\r\n      <br>\r\n      Insert Place\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Andrew Werfelmann\r\n      <br>\r\n      206-389-21602\r\n      <br>\r\n      awerfelmann@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="toc"></a>\r\n<h2>\r\n  Transportation Operators Committee\r\n</h2>\r\n<p>\r\n  The Transportation Operators Committee includes representatives of the public transit agencies in each county, the Regional Transit Authority, and the state Department of Transportation's Ferry Planning Office, Urban Mobility Office, and Transportation and Rail Division. Deals specifically with transit-related issues.\r\n</p>\r\n<p>\r\n  <a href="other#">Transportation Operators Committee Member List</a>\r\n</p>\r\n<p>\r\n  <a href="pdf/toccaucus20077.pdf">TOC 2007 Meeting Schedule</a> [pdf]\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Friday, March 16th, 2007\r\n      <br>\r\n      10:00 - 12:00 noon\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Libby Parham\r\n      <br>\r\n      206-389-2159\r\n      <br>\r\n      lparham@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="steftac"></a>\r\n<h2>\r\n  Seattle-Tacoma-Everett FTA Caucus\r\n</h2>\r\n<p>\r\n  The Seattle-Tacoma-Everett FTA Caucus is a subcommittee to the Transportation Operators Committee (TOC). The Caucus membership includes public transportation agencies providing transit services in King, Pierce and Snohomish counties. Its primary responsibility is to recommend a program of Federal Transit Administration urbanized formula program (also known as 5307) funds, and Fixed Guideway Capital program (also known as 5307 FG) funds for transit projects within the Seattle-Tacoma-Everett urbanized area as part of a coordinated regional TIP proposal to the TOC. The final TOC recommendations are forwarded to the Regional Council's Policy Boards-via the Transportation Policy Board to the Executive Board.\r\n</p>\r\n<p>\r\n  <a href="other#">Seattle-Tacoma-Everett FTA Caucus Member List</a>\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Tuesday, March 13th, 2007\r\n      <br>\r\n      1:00 - 2:30 p.m.\r\n      <br>\r\n      1011 Western Avenue, 5th Floor\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Libby Parham\r\n      <br>\r\n      206-389-2159\r\n      <br>\r\n      lparham@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="bpac"></a>\r\n<h2>\r\n  Bicycle/Pedestrian Advisory Committee\r\n</h2>\r\n<p>\r\n  The Bicycle/Pedestrian Advisory Committee coordinates with and advises Regional Council staff, policy boards, and other advisory committees on a variety of bicycle and pedestrian-related planning issues. Meets quarterly. Representatives from member jurisdictions, bicycle and pedestrian interest groups from the central Puget Sound region are welcome to attend.\r\n</p>\r\n<p>\r\n  To receive periodic emails announcing events, committee meetings and resources related to bicycle/pedestrian planning, please contact Kirste Johnson.\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>To be Announced\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Kirste Johnson\r\n      <br>\r\n      206-587-5665\r\n      <br>\r\n      kjohnson@psrc.org\r\n    </li>\r\n  </ul>\r\n</div><a name="sns"></a>\r\n<h2>\r\n  Special Needs Subcommittee\r\n</h2>\r\n<p>\r\n  The primary purpose of the Special Needs Subcommittee is to help develop a Coordinated Human Services and Public Transit Plan for the region. This committee meets monthly and advises the Transportation Operators Committee on special needs transportation, and transit. Members include representatives from transit agencies, human services providers, nonprofit transportation providers, the American with Disabilities Act community advocates, agencies involved with jobs access services for low-income individuals, agencies on aging, and others.\r\n</p>\r\n<div>\r\n  <h3>\r\n    Next Meeting\r\n  </h3>\r\n  <ul>\r\n    <li>Wednesday, March 28th, 2007\r\n      <br>\r\n      10 AM - Noon\r\n      <br>\r\n      Sound Transit\r\n      <br>\r\n      401 S. Jackson Street, Seattle\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div>\r\n  <h3>\r\n    Contact\r\n  </h3>\r\n  <ul>\r\n    <li>Benjamin Brackett\r\n      <br>\r\n      206-389-2162\r\n      <br>\r\n      bbrackett@psrc.org\r\n    </li>\r\n  </ul>\r\n</div>\r\n	182
233	body	Textile	<p>\r\n  The Transportation Policy Board includes representatives of the Regional Council's member jurisdictions and regional business, labor, civic and environmental groups. Meets monthly to make recommendations on key transportation issues to the Executive Board.\r\n</p>\r\n<div class="officers">\r\n  <img src="../images/officers-patterson.jpg" height="140" alt="Julia Patterson" width="100">\r\n  <p>\r\n    Councilmember Julia Patterson\r\n    <br>\r\n    Chair\r\n  </p>\r\n</div>\r\n<div class="officers">\r\n  <img src="../images/officers-patterson.jpg" height="140" alt="Brenda Stonecipher" width="100">\r\n  <p>\r\n    Councilmember Brenda Stonecipher\r\n    <br>\r\n    Vice Chair\r\n  </p>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Next Meeting\r\n  </h2>\r\n  <ul>\r\n    <li>March 8, 2007 - 9:30-11:30 a.m.\r\n    </li>\r\n    <li>1011 Western Avenue, 5th Floor\r\n    </li>\r\n  </ul>\r\n</div>\r\n<div class="meetings">\r\n  <h2>\r\n    Past Meetings\r\n  </h2>\r\n  <ul>\r\n    <li>\r\n      <a href="pdf/tpb_agenda_020807.pdf">Agenda for meeting held 2/8/07</a> [pdf]\r\n    </li>\r\n    <li>\r\n      <a href="minutes">Minutes - Past Meetings</a>\r\n    </li>\r\n    <li>\r\n      <a href="at-work">At Work - Past Meeting Summaries</a>\r\n    </li>\r\n  </ul>\r\n</div>\r\n<h2>\r\n  Composition &amp; Membership\r\n</h2>\r\n<table class="compMember" cellspacing="0" border="0" width="100%" cellpadding="0">\r\n  <tr>\r\n    <th colspan="3">\r\n      King County/Cities (7)\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <td colspan="3"></td>\r\n  </tr>\r\n  <tr>\r\n    <td class="location" rowspan="4">\r\n      King County (2)\r\n    </td>\r\n    <td>\r\n      Councilmember Julia Patterson\r\n    </td>\r\n    <td>\r\n      206-296-1013\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td>\r\n      Councilmember Reagan Dunn\r\n    </td>\r\n    <td>\r\n      206-296-0198\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td>\r\n      <em>Councilmember Kathy Lambert (Al