151	body	Textile	The Puget Sound Regional Council is updating Destination 2030, the region's long range transportation plan, and is asking for input on how to best keep the region moving as it grows by 1.4 million people by 2040.\r\n\r\n\r\nOriginally adopted in 2001, Destination 2030 lays out a strategy to meet regional transportation demands in King, Kitsap, Pierce, and Snohomish counties until the year 2030.\r\n\r\n\r\nTransportation 2040 will extend the plan horizon to 2040 and evaluate ways to keep the region moving and the economy prospering as the population grows. At the same time, we must protect the environment, natural resources, and quality of life that people in the region enjoy. The updated plan will continue to meet federal transportation planning requirements and state Growth Management Act, and will align with the Regional Economic Strategy and the updated Regional Growth Strategy - VISION 2040. 	133
