32	body	Textile	http://draft.psrc.org/assets/7/bdrewel.jpg\r\n<p>\r\n  Bob Drewel is the Executive Director of the Puget Sound Regional Council. The PSRC was formed in 1991 by the local governments in the central Puget Sound region as a forum for making key decisions on regional growth and transportation issues. The PSRC serves as the Metropolitan Planning Organization and Regional Transportation Planning Organization for King, Kitsap, Pierce and Snohomish counties and cities. The PSRC supports the work of the Central Puget Sound Economic Development District through a merger that took effect in 2003.\r\n</p>\r\n<p>\r\n  Bob Drewel completed his third and last term as Snohomish County Executive in December 31, 2003. He was first elected to that position in November 1991.\r\n</p>\r\n<p>\r\n  Bob is well known for his leadership in promoting regional solutions to the many challenges facing the Northwest, including economic development, effective land-use regulation, transportation, and environmental enhancement. In his twelve years of public service, Bob has successfully worked to build partnerships between the often-contending interests of the private and public sectors ... partnerships that are based on shared visions for a healthy and vigorous community.\r\n</p>\r\n<p>\r\n  Within Snohomish County, he has helped build community partnerships as a board member of the Economic Development Council, Healthy Communities Initiative, United Way, Snohomish County Tomorrow, Snohomish County Needs Assessment Project, Economic Investment Plan, SnoNet and City/County Task Force on Criminal Justice.\r\n</p>\r\n<p>\r\n  Other civic involvement includes the Henry M. Jackson Foundation, Rotary, Everett Area Chamber of Commerce, Big Brothers Big Sisters, Deaconess Children's Services, YMCA and numerous other community projects.\r\n</p>\r\n<p>\r\n  Bob is past president and member of the executive board of the Puget Sound Regional Council, and the former chairman of Sound Transit.\r\n</p>\r\n<p>\r\n  Bob is the former president and chief executive officer of Everett Community College.\r\n</p>\r\n<p>\r\n  Bob is a 1970 graduate of the University of Washington. He lives in Arlington with his wife, Cheryl. They have two grown daughters.\r\n</p>\r\n<p>\r\n  To request Bob Drewel to speak to your group or organization, please <a href="http://psrctest.cevian.net/about/request_bob_drewel.htm">complete this form</a>.\r\n</p>\r\n<p>\r\n  To download a photo of Bob to use for printing, <a href="../images/drwl4m-300dpi.tif">click here</a>.\r\n</p>\r\n	13
155	body	Textile	<h2 class="top">\r\n  Background\r\n</h2>\r\n<p>\r\n  The central Puget Sound region has grown a lot in the past 30 years and it will grow a whole lot more over the next 30 years. Like every successful metropolitan region, we have a big challenge when it comes to making traffic better.\r\n</p>\r\n<p>\r\n  Traffic around here is expected to grow by 60 percent over the next 30 years, and even though we have comprehensive plans that guide investments, we're way behind in delivering on the combination of roads and transit required to meet the need. Some people think there's no way in the world that we'll ever come up with all the money to keep up with a transportation backlog of over $30 billion in our region. So in the long-term we will need new ideas and new solutions that can help us make the most out of the facilities and services we have.\r\n</p>\r\n<p>\r\n  Our region has always been innovative. One innovative idea is to try new incentives and disincentives for traffic on our roads - to help improve traffic flow as well as help pay for the roads and transit we need. These ideas include allowing people a choice to buy into a faster lane, or, charging fees to be on roads when they're most clogged - while making sure that everyone can also choose among many different ways to reach their destination.\r\n</p>\r\n<p>\r\n  Giving people a choice seems to be the key to making these ideas work.\r\n</p>\r\n<p>\r\n  In an ideal world, economists theorize that this type of innovation can reduce the costs of transportation for all of us, and also provide more funding to build and operate what we need. But this is mostly uncharted territory.\r\n</p>\r\n<p>\r\n  It makes sense to take a serious look at what's likely to work around here, sort out all the pluses and minuses, before making any big changes in our plans.\r\n</p>\r\n<p>\r\n  That's what the Puget Sound's Traffic Choices Study is all about.\r\n</p>\r\n<p>\r\n  Citizens from our region, all volunteers, have helped all of us to begin to get our questions answered, and help us all sort out the next steps.\r\n</p>\r\n<p>\r\n  The Traffic Choices Study is a federally funded pilot that is testing new ways to combat traffic congestion and fund transportation. Our region is developing a better understanding of the policy and technical issues associated with road pricing, the results of which will inform updates to the region's plans and influence decisions about our future.\r\n</p>\r\n	136
94	body	Textile	h3(top). Getting Ready for the Future\r\n\r\nThe mission of the Puget Sound Regional Council is to play a key regional role in keeping central Puget Sound thriving as we grow. PSRC is committed to creating a great future for the region through planning for regional transportation, land use and economic development, under authority embodied in state and federal laws.\r\n\r\n<img src="/images/seattle2.png" alt="Seattle" class="border" />\r\n\r\nh3. Working Together\r\n\r\nAt PSRC, central Puget Sound counties (King, Pierce, Snohomish and Kitsap), cities and towns, ports, tribes, transit agencies, and the state work together to develop<br />policies and make decisions about regional issues.\r\n\r\nh3. Regional Decisions Informed by Solid Research and Collaboration\r\n\r\nPSRC works with local government, business and citizens to build a common vision for the region's future, expressed through three connected major activities: VISION 2040, the region's growth strategy; Destination 2030, the region's comprehensive long-range transportation plan; and Prosperity Partnership, which develops and advances the region's economic strategy.\r\n\r\nVISION 2040 is the region's strategy for addressing anticipated growth of population and employment through 2040. VISION 2040 describes how and where we can grow while also supporting the well-being of people and communities, economic prosperity and a healthy environment.\r\n\r\nDestination 2030 is the region's long-range transportation plan. PSRC is now updating the plan, extending it to 2040 and evaluating ways to keep the region moving as the population grows.\r\n\r\nProsperity Partnership, via the PSRC's Economic Development Board, has convened over 260 public and private groups to develop and advance a regional economic strategy to enhance the region's economic vitality.\r\n\r\nPSRC Data: PSRC is a rich data resource for the entire region - providing the data tools required to plan for the long term and inform decisions made every day. PSRC forecasts, shown above, anticipate the region will have 1.4 million more residents and 1.1 million more jobs by 2040 (based on year 2007 totals).\r\n\r\nPSRC Funding: PSRC distributes about $160 million in federal transportation funds each year. One example, shown above: SR 99 projects funded by PSRC are helping ease traffic and transit flow and improve safety along this key state highway.\r\n\r\nh3. PSRC Leadership and Organization\r\n\r\nPSRC is governed by a General Assembly and an Executive Board. Each member of PSRC is a voting member of the General Assembly, which meets at least annually to vote on major decisions, establish the budget, and elect new officers. The Executive Board is chaired by the PSRC President, meets monthly, and serves as the governing board. Both the General Assembly and Executive Board use weighted votes based on population to make decisions.\r\n\r\nThe Transportation Policy Board and Growth Management Policy Board include representatives of PSRC's member jurisdictions, tribes, regional business, labor, civic, and environmental groups, as well as voting members representing each caucus of the state Legislature. These boards make recommendations on key transportation and growth management issues to the Executive Board.\r\n\r\nPSRC also supports the work of the region's Economic Development District, governed by a board composed of public and private members that meets quarterly to coordinate regional economic development planning.\r\n\r\nh3. Budget and Funding Sources\r\n\r\nThe two-year budget (July 1, 2007 to June 30, 2009) for PSRC is $23.7 million. The agency receives 74 percent of its revenue from federal grants, 6 percent from state grants, and the remaining 20 percent from dues paid by PSRC members and from other local sources.	75
