143	body	Textile	The Regional Council is involved in a wide variety of activities related to planning and support for the Central Puget Sound region's public use airport system. The system includes Seattle-Tacoma International Airport, 5 General Aviation Reliever airports, 20 other General Aviation airports, and two Military airfields. Program activities include continuing actions under Resolution A-96-02 (supporting the third runway at Sea-Tac Airport), airport ground access planning, regional air cargo planning, cooperative efforts with the WSDOT Aviation Division in planning for long-range airport capacity, and on-going efforts to address airport compatible land use under the Regional Council's growth management act (GMA) authority.\r\n\r\n* "Regional Air Cargo Strategy":# has been completed\r\n* Results of the "Sea-Tac Airport Community Impact Survey":# are now available\r\n* The "9th Annual Air Transportation Progress Workshop":# was held Thursday January 12, 2006 at the Highline School District Board Room in Burien\r\n* PSRC is working with the Washington State Department of Transportation Aviation Division on the "Washington State Long-term Air Transportation Study (LATS)":#\r\n* The Regional Council has prepared a "staff report":# on the proposed Southwest Airlines move to Boeing Field\r\n\r\nFor more information, contact Stephen Kiehl, skiehl@psrc.org, 206-464-6715.\r\n\r\n	124
