469	body	Textile	Many pre-defined layouts have been created for easy use within the CMS.  While creating or editing a page, you may select the specific layout that you would like to use.  If no layout is selected, the layout will default to inherit the layout from the parent page.  For more information on parent/child pages, see "File Management":/docs/file-management.  Below are examples of the available layouts:\r\n\r\np(float-right). <r:assets:image title="layouts" />\r\n<r:find url="/docs/layouts/"><r:children:each>* <r:link />\r\n</r:children:each></r:find>\r\n\r\nh3. Adding Content to Page Parts\r\n\r\nTo specify where content should be placed within the layout requires the use of page parts. When you create a page, the following blank page parts are automatically added to the page:\r\n\r\n<r:assets:image title="page-parts" /> \r\n\r\nThese are tabs that allow you to add content to various parts of the pages. Each content area within the layout requires a specific page part. \r\n\r\n|_. Layout Section |_. Page Part Label |\r\n| Main Column (Column 1) | body |\r\n| Column 2 | col2 |\r\n| Column 3 | col3 |\r\n| Sidebar Navigation | navigation |\r\n\r\n\r\nFor example, if you want to use a 2 column layout, you would put the content for Column 1 in the 'body' page part, and the content for Column 2 in the "col2" page part.  The other page parts can be left blank.  \r\n\r\nYou may have noticed the page part "Summary", this page part is used in cases where only the summary of the page is shown on another page.  "View the snippets topic for more information":/docs/snippets\r\n\r\nh3. Next Steps\r\n\r\nUsing these layouts and basic textile elements works most of the time, however, sometimes you need to trim off some white space, or add some whitespace, or even follow a specific design pattern like having a photo with a caption directly beside it.  To do this, read on to for "advanced page editing":/docs/advanced-page-editing	247
