453	body	Textile	This purpose of this page is to outline the basic elements and tools that you will need while you are editing the content for a single page.\r\n\r\n<a name="getting-started"></a>\r\nh3. Getting Started\r\n\r\nTo get started editing a page, click on a page title in the pages tab of the admin control panel. \r\n\r\n<r:assets:image title="click-to-edit" />.  \r\n\r\nGo to the "file management documentation":/docs/file-management for more information.\r\n\r\n<a name="page-input-fields"></a>\r\nh3. Page Input Fields\r\n\r\nh4. Title\r\n\r\nThe title of your page.  You can use any words, phrases, commas, quotes, hyphens/dashes, and other typical symbols.  The CMS will automatically clean it up for the link to the post.  Eg. "About PSRC!" automatically will make "about-psrc" as the "page-slug".  Read on to learn more about what a page slug is.\r\n\r\np(float-right). <r:assets:image title="more-link" />\r\n\r\nh4. Slug (in more link)\r\n\r\nThe slug is what is shown in the URL for that page.  For instance, if the URL to a page is http://www.psrc.org/about-psrc, "about-psrc" would be the slug for that page.  The default slug is the title with dashes replacing spaces and is automatically filled in while you fill in the title of the page.  If you would like a shorter link (eg. http://www.psrc.org/about), click on the "more" link under the page title field and you can customize the slug text.\r\n\r\nh4. Breadcrumb (in more link)\r\n\r\nBreadcrumbs on the page are shown at the top of every page (except the front page) above the banner. By default the breadcrumb matches the page title. For example, this page has "Home  Documentation  Basic Page Editing".  By editing this breadcrumb field to "Basics", it will change the breadcrumbs to "Home  Documentation and Style Guide  Basics" while still keeping the page title "Basic Page Editing"\r\n\r\nh4. Description & Keywords (in more link)\r\n\r\nAdds meta-data for the page.  Can be used for search engine optimization and/or dynamic filtering through snippet tags. Default is blank.\r\n\r\nh4. Page Editing Area\r\n\r\nThe big blank box where you enter your writing, links, links to images, and any information you want to display on the page. Read on to learn how to fill this input to add content to the page.\r\n\r\nh4. Layout\r\n\r\nUse this selector to change the page to use one of many pre-defined layouts.  "Learn more about these layouts":/docs.\r\n\r\nh4. Page Type\r\n\r\nThe page type is for site admins to create 'special' pages such as error pages.  99% of pages should be set to the default value <normal>.\r\n\r\nh4. Status\r\n\r\nThe Status menu determines the pages visibility. Only "Published" pages will be visible on the live site. Use "Draft" or "Reviewed" for pages that are still in progress and shouldn't be shown on the live site. For most cases, this should be kept on the default "published" state.\r\n\r\nIf a page isnt showing up or links to it give a page not found response make sure its status is set to "published".\r\n\r\nh4. Preview\r\n\r\nThis button allows you to view your changes without having to save the edits to the page and without having to leave the page.  Clicking on this button will add an inline window below the button reflecting changes.\r\n\r\n<a name="adding-content-with-textile"></a>\r\nh3. Adding Content with Textile\r\n\r\nEditing pages requires the brief knowledge of a text markup known as "Textile". Textile is a simple text markup which converts to HTML through the use of simple symbol conventions. By using Textile, you will not have to learn/use HTML to modify pages. For example, using @*this is bold*@ instead of @<strong>This is bold</strong>@\r\n\r\np(float-left). <r:assets:image title="textile" />\r\n\r\nFor many examples on how to use Textile, view the "*Textile Reference*":http://hobix.com/textile/.  \r\n\r\nFor basic text editing you can take advantage of the the buttons placed at the top of the page editing area will allow you to append the corresponding format option to your input. By using these formatting options, it will generate basic HTML which in most cases will not need to be changed.  \r\n\r\nTo get a better understanding of how Textile works view the "basic style guide page":/docs/basic-page-editing/style-guide, then look at the "edit page":/docs to see how the textile markup is being used. Additionally, all of the documentation pages are using textile.  View edit pages for the documents for more examples.\r\n\r\n<a name="basic-style-guide"></a>\r\nh3. Basic Style Guide\r\n\r\nTo see the general structure for how sub-pages should be marked up, "view the basic style guide":/docs/basic-page-editing/style-guide.\r\n\r\n<a name="adding-images"></a>\r\nh3. Adding Images\r\n\r\np(float-right). <r:assets:image title="assets" alt="Assets" /> \r\n\r\nThere are a few ways to link to images.  First, you will need to upload the image to the CMS.  To do so, click on the Assets tab, click on the "New Asset" button and follow instructions to upload your image.  Once your image is uploaded, you can reference the image from your page by one of the following methods:\r\n\r\n* @r:assets:image title="ASSET TITLE"@ - By Asset Title (Generated by textile editor button (above page editing input area)\r\n* @r:assets:image id="24"@ - By Asset ID\r\n* <notextile>@!/assets/24/asset-title.png!@ - by Asset Path (Textile style)</notextile>\r\n\r\nh4. Adding an Alt Tag to Images\r\n\r\nAdding alternative (alt) text tags to images is a good idea for accessibility.  This is the text that shows up if the image can not be shown or what is used in replace of the image for screen readers. The following shows how the above code can be modified to use an alt tag for the image.\r\n\r\n* @r:assets:image title="ASSET TITLE" alt="ALTERNATIVE TEXT"@\r\n* @r:assets:image id="24" alt="ALTERNATIVE TEXT"@\r\n* <notextile>@!/assets/24/asset-title.png(ALTERNATIVE TEXT)!@</notextile>\r\n\r\n<a name="positioning"></a>\r\nh3. Positioning\r\n\r\nDoes your content need to have more than one column or maybe it needs a sub-navigation list of links on the side? Rather than worry about creating elements for building the structure of the page, many pre-defined layouts have been created for easy use.  Take a look at the "layouts documentation":/docs/layouts for more information.\r\n\r\nh3. Next steps\r\n\r\nNeed more a little more control to add certain design patterns or control white space on these basic elements? Learn how to utilize "advanced page editing":/docs/advanced-page-editing techniques.	243
