477	body	Textile	Logging into the Content Management System (CMS) will take you to the "page" tab within the CMS admin control panel.  Here you will find the entire file (page) hierarchy of the entire PSRC site (also called a site-map). Viewing pages and sub-pages work very similar to a Microsoft Windows file explorer system as you can toggle the children of parent pages by clicking on the +/- icon.  From here you will be able to create new pages, edit exiting pages, and/or delete pages.\r\n\r\np(align-center). <r:assets:image title="page-management" size="original" />\r\n\r\n<a name="creating-sub-pages"></a>\r\nh3. Creating Sub-Pages\r\n\r\nSince all pages are within a hierarchy, with the front page being the top-most parent, all other pages must be children to the front page. Therefore, each new page must be placed within a specific place within the hierarchy. To do so, click on an an Add Child link to add a new child page to the given page. \r\n\r\n<a name="deleting-pages"></a>\r\nh3. Deleting Pages\r\n\r\nClick on the "Remove" link to delete a page.  This will take you to a confirmation page.  Database backups, which contain the content for all pages within the CMS, are backed up daily allowing it to be possible to recover a mistakenly deleted page.\r\n\r\n<a name="user-roles"></a>\r\nh3. User Roles\r\n\r\nBy clicking on the "Users" link at the top right of any page in the admin section, you can create/edit/delete users.  So it is possible for each employee or each department within PSRC to have it's own user name and password.  There are also two different user roles.  One is "Admin" and the other is "Developer", both roles have exactly the same amount of access and control, except only the admin role has access to publish the site to the live server.  "Learn more about publishing to the live server":/docs/updating-the-live-server\r\n\r\nh3. Next Steps\r\n\r\nRead "Basic Page Editing":/docs/basic-page-editing for more information.	249
